INSERT INTO `webfautheque_defaut` (`id`, `defaut_idperso`, `defaut_nom`, `defaut_image`, `defaut_description`, `defaut_info`, `defaut_causes`, `defaut_remedes`, `sous_groupe_id`) VALUES
	(1, 'A111', 'Bavure de joint ou Barbe', '', 'Toile (ou bavure) de faible épaisseur dans le plan de joint ou dans une portée de noyau.', 'Excroissance plate, de largeur irrégulière, de profil souvent dentelé, généralement normale à une des faces de la pièce.Elle se trouve le long d\'un joint du moule, d\'une portée de noyau ou de toute surfcae de séaration entre les éléments constituant le moule.\r\n\r\nLes dimensions principales, en particulier l\'épaisseur, ne sont pas affectées (à la différence du défaut A121, soulèvement de moule).\r\n\r\nLes bavures peuvent accélérer le refroidissement des parties voicines et provoquer des criques (défaut C221) ou, s\'agissant de fonte, des zones trempées (défaut G211).', 'Jeu entre deux éléments du moule ou entre moule et noyau ou joint mal raccordé.', '- Soigner l\'exécution des modèles, des moules et des noyaux.\r\n- Contrôler leurs dimensions.\r\n- Contrôler les remmoulages.\r\n- Tamponner s\'il y a lieu.', 1),
	(2, 'A112', 'Gerce ou Nervure', 'None', 'Excroissance en forme de veines à la surface du moulage.', 'Excroissances en forme de veines, généralement perpendiculaires à la surface, isolées ou en réseau et non situées le long des joints.\r\n\r\nEn moulage à vert, elles apparaissent souvent au voisinage des angles et en même temps que le défaut D230 (gales) ou A211 (forçage).\r\n\r\n* Ce défaut a quelquefois été appelé improprement FRIASSE.', '- Craquelures à la surface du moule se produisant au cours du séchage, lorsqu\'il y a une trop forte tendance du sable au retrait par suite de :\r\n    \r\n-Chauffage trop rapide,\r\n-Température trop élevée, en particulier au début de l\'étuvage,\r\n-Trop forte teneur en agglomérant ou en humidité.\r\n\r\n- Craquelures au moment de la coulée d\'un sable trop compact ou trop riche en silice, début de formation de gales - voir défaut D230.\r\n- Fissures de moule accompagnant le forçage de gravité (A211).', 'En fonction des causes présumées :\r\n    \r\n- Régler la composition du sable et l\'étuvage. Reboucher les craquelures du moule.\r\n- Voir les mesures propres à empêcher les gales (défaut D230). \r\n- Augmenter la rigidité du moule. \r\n- Diminuer la pression du métal liquide.\r\n\r\nVoir bibliographie A112 et D230.', 1),
	(3, 'A113', 'Moule craquelé', 'None', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus rutrum, tortor quis. Excroissance en réseau à la surface de pièces coulées sous pression.', 'Formation d\'un réseau de fines bavures à la surface de moulages exécutés par gravité ou sous pression.\r\n\r\n- Le plus souvent sur les surfaces qui correspondent à des régions de la coquille ou du moule soumises à de hautes contraintes thermiques surtout avec des moules pour alliages à haut point de fusion et aussi avec des alliages d\'aluminium.\r\n- Dans la zone des attaques, car elle est soumise aux plus grands écarts de température.\r\n- Dans les régions du moule où le métal liquide circule à la plus grande vitesse (écarts de température et érosion).\r\n- En général après un long emploi du moule.', 'Les alternances de température du moule provoquent des alternances de contraintes de traction et de compression qui provoquent des fissures superficielles.', '- Choix des attaques donnant les courants de métal liquide les moins nocifs pour le moule. \r\n- Utilisation pour les moules d\'un acier de haute qualité.\r\n- Refroidissement rationnel du moule après mesure des températures dans les diverses régions de l\'outillage.\r\n- Avec les métaux légers en coulée sous pression : traitement thermique de détente du moule après environ 20000 injections. \r\n- Traitement de surface du moule (par exemple: nitruration).', 1),
	(4, 'A114', 'Gales d\'angle', 'None', 'Excroissance mince parallèle à une surface dans les angles rentrants.', 'Excroissance métallique ayant la forme d\'une lame mince de contour irrégulier située dans des angles rentrants, des coins ou au voisinage d\'arêtes, à une distance de 2 à 5 mm de la surface et parallèlement à celle-ci.\n\nLorsqu\'elle est située du côté inférieur du moulage, elle est toujours accompagnée de queues de rats (défaut D132).', 'Formation d\'une écaille de sable non rompue due à une irrégularité de dilatation de la silice. Voir aussi gales (défauts D230).\nCe défaut est moins fréquent en sable étuvé et, dans ce cas, il peut provenir d\'un étuvage insuffisant ou d\'une reprise d\'humidité au cours d\'un trop long délai séparant l\'étuvage de la coulée.', 'Voir D230 (gale).', 1),
	(5, 'A115', 'Gerce d\'angle', 'None', 'Excroissance métallique mince située dans un angle rentrant et partageant cet angle en deux parties.', 'Excroissance en forme de lame mince divisant en deux un angle rentrant du moulage; elle n\'est donc ni parallèle, ni perpendiculaire à une face du moulage.', 'Fente du moule ou du noyau se produisant au cours de l\'étuvage ou de la coulée et pouvant être favorisée par une trop forte proportion d\'agglo mérant dans le sable.', 'Diminuer la teneur en agglomérant ou modifier sa nature.', 1),
	(6, 'A121', 'Soulèvement du moule', 'None', 'Toile épaisse attenante au moulage dans le plan de joint.', 'Excroissance plate, plus ou moins épaisse, de profil dentelé et de surface lisse, en général normale à l\'une des faces latérales du moulage.\n\nElle se trouve le long des joints du moule, des portées ou des mottes et est accompagnée d\'un accroissement correspondant de l\'épaisseur du moulage.', 'Excès de pression statique ou dynamique du métal liquide qui produit un soulèvement de la partie de dessus si la charge n\'est pas suffisante ou si le crampage est défectueux.', '- Proportionner la charger à la poussée ou assurer un crampage correct.\n- Si c\'est possible réduire la hauteur du jet de coulée.', 2),
	(7, 'A122', 'Défoncement du moule', 'None', 'Toile épaisse en d\'autres endroits du moulage.', 'Excroissance en forme de voile irrégulier, plus ou moins épais, à surface rugueuse et irrégulière, partant en général des arêtes inférieures du moulage, en angle obtus, et pouvant aller jusqu\'à la face inférieure du moule. Les dimensions verticales du moulage sont accrues.\n\nPeut provoquer le défaut E123, moule vidé.', 'Sous l\'influence de la pression statique pendant la coulée, la résistance de la couche de sable qui forme le fond du moule est dépassée, ce qui peut résulter d\'une mauvaise disposition de l\'empreinte dans le moule et/ou d\'une trop faible charge du châssis combinées avec un serrage du sable insuffisant ou irrégulier. Le fond du moule est alors arraché.', '- Accroître la résistance à vert du sable par un serrage suffisant et régulier et le choix d\'un agglomérant approprié, présent à une teneur déterminée en fonction des efforts à supporter.\n- Faire reposer les moules sur une aire plane et propre.\n- Charger le moule, y compris le châssis, de façon suffisante.\n- Si possible diminuer la hauteur de la descente de coulée.', 2),
	(8, 'A123', 'Moule fendu', 'None', 'Formation de toiles dans un plan déterminé par rapport à la direction de montage (coulée de précision en modèle perdu).', 'MOULAGE DE PRÉCISION A MODÈLE PERDU.\r\nFormation d\'importantes toiles minces dans un plan déterminé par rapport à la direction de montage.\r\n\r\n Se produit à la surface et passe par une zone de moindre résistance du moule', 'Le moule a été fendu :\r\n- lors des revêtements,\r\n- au moment du décirage,\r\n- au cours du cycle thermique que le moule subit (moule-bloc), \r\n- par suite d\'un mauvais choix des matériaux ou d\'une insuffisance de résistance des couches.', '.', 2),
	(9, 'A211', 'Forçage extérieur ou intérieur', 'None', 'Surépaisseur sur les faces externes ou internes du moulage.', 'Excroissances massives et irrégulières sur les faces intérieures et extérieures et sur les arêtes du moulage, généralement étendues et rugueuses souvent en combinaison avec les défauts D 121 (rugosité), D 122 (péné tration) et A 112 (gerces).', 'Forçage de gravité A 211 -1:\n    \n    - serrage du sable insuffisant,\n    - étuvage incomplet,\n    - pression statique et/ou dynamique du métal liquide trop importante. \n    \n    Forçage de solidification A 211 -2:\n    Seulement dans le cas de la fonte grise et de la fonte GS.\n    \n    - déformation du moule (de rigidité insuffisante) sous l\'effet du gonflement de la pièce provoqué par la formation du graphite en cours de refroidissement,\n    - le défaut s\'accompagne souvent, dans ce cas, de retassure interne (B 221) ou de porosité (B 311).', '- Forçage de gravité :\n    \n- augmenter le serrage des parties de moule sujettes au défaut ou leur\nteneur en agglomérant,\n- substituer au sable vert le sable séché ou durci, modifier la disposition de la pièce dans le moule ainsi que le tracé des jets de coulée afin de diminuer la pression du métal liquide.\n    \n- Forçage de solidification :\n    \n- augmenter la rigidité du moule comme ci-dessus (sable et châssis).', 3),
	(10, 'A212', 'Erosion', 'None', 'Surépaisseur au voisinage de l\'attaque ou au-dessous de la coulée.', 'Excroissance de forme irrégulière et généralement rugueuse des faces d\'un moulage, en général au voisinage des attaques ou de la face inférieure, au droit d\'un jet de coulée, ou se situant le long du trajet du métal liquide dans l\'empreinte. On trouve souvent des inclusions de sable en d\'autres régions du moulage.', '#NOM?', '- Amélioration du pouvoir agglomérant du liant à haute température. Serrage plus énergique et plus régulier.\n- Contrôle de l\'étuvage du moule et des noyaux.\n- Étude du dispositif de coulée en évitant l\'entrée trop rapide ou trop localisée du métal liquide dans l\'empreinte et un lavage trop prolongé d\'une même région de moule ou de noyau. Éviter que le jet de métal liquide ne vienne frapper directement des arêtes de sable ou des parois verticales de l\'empreinte.\n- Utilisation de jets de coulée en céramique et/ou de noyaux filtres.\n- Renforcer les zones menacées des parois de l\'empreinte en les consti tuant de produits réfractaires ou en les protégeant par une couche résistante.', 3),
	(11, 'A213', 'Frotte', 'None', 'Excroissance en forme de plages allongées dans le sens d\'un remmoulage à faible jeu.', 'Excroissance non géométrique sur les surfaces verticales ou obliques du moulage dans la direction de la fermeture du moule ou de l\'introduction d\'un noyau. En général, on peut en trouver en plusieurs régions d\'un même moulage. Souvent combinée avec des inclusions de sable.', 'Lors du remmoulage, principalement lorsqu\'il y a des parties en forte saillie, des arêtes ou des faces du moule ont frotté l\'une contre l\'autre avec arrachement de sable (voir schéma). Ce défaut peut également se produire lors de l\'introduction de noyaux.', '- Améliorer si possible le tracé de la pièce dans le sens d\'une plus grande dépouille ou d\'une plus forte épaisseur.\n- Utiliser un engoujonnement correct (précision et longueur).\n- Soigner et vérifier le remmoulage.', 3),
	(12, 'A221', 'Chute de sable', 'None', '...à la surface supérieure du moulage.', 'Excroissance irrégulière, massive à apparence de cassure, sur la face supérieure du moulage. On retrouve en général sa contrepartie sous forme d\'inclusion de sable ou de manque de matière.\n\nCe défaut, à l\'inverse du défaut A 224 (cassure du moule) se produit aussi sur des faces de moulage lisses, sans qu\'il y ait une gale au-dessous de lui (D 231).', 'Le sable de contact ou, de façon plus générale, la couche de sable voisine du modèle, n\'adhère pas assez au sable de remplissage et se détache :\n    \n- au moment du démoulage (sable collé au modèle),\n- pendant la manutention du moule,\n- pendant le remmoulage.\n\nLa tenue insuffisante du sable provient d\'un pouvoir agglomérant insuffisant (trop faible résistance à vert) surtout lorsque le moule est réalisé par couches séparées (sable de contact et sable de remplissage) ayant des propriétés à vert différentes. La séparation des éléments du moule peut être provoquée au moment de la coulée par la dilatation de la couche de contact. Mais, il s\'agit alors du défaut D 231 (gale).', '- Augmenter la proportion d\'agglomérant dans le sable du moulage. \n- Éviter de fortes différences de propriétés à vert et surtout de résistance, quand plusieurs sables doivent être employés dans un même moule.\n- Serrer régulièrement le sable. \n- Vérifier le moule avant le remmoulage. Réparer les points endommagés au démoulage. Employer des pointes ou des crochets.', 4),
	(13, 'A222', 'Soulèvement d\'un élément de moule ou du noyau', 'None', '...à la surface inférieure du moulage (excroissance massive).', 'Excroissance massive irrégulière qui peut boucher tout à fait l\'ouverture inférieure d\'un moulage en forme de cuve. Elle présente la forme d\'une partie massive de moule ou de noyau détaché. On retrouve généralement sa contrepartie sous la forme d\'inclusion de sable ou de manque de matière.\n\nElle se manifeste surtout sur des moulages d\'une certaine hauteur emballés debout.', '- Arrachage d\'une certaine quantité de sable emballé par suite d\'un démoulage maladroit.\n- Résistance du sable insuffisante.\n- La pression du métal liquide pénétrant dans l\'empreinte est trop élevée et arrache le sable emballé.\n- Manque de pointes et de crochets dans le cas d\'un emballage d\'une certaine hauteur.\n- Une fissuration due par exemple à un étuvage trop brutal offre une possibilité de pénétration au métal dont la pression élargira la fissure jusqu\'à rupture complète.', '- Démouler correctement.\n- Augmenter la teneur du sable en agglomérant (amélioration de la résistance à vert).\n- Déplacer les attaques et diminuer la pression du métal liquide qui pénètre dans l\'empreinte.\n- Mettre des crochets et des pointes.\n- Étuver lentement.\n- Boucher les fissures.\n- Caler par des supports les mottes importantes.', 4),
	(14, 'A223', 'Soulèvement de sable', 'None', '...à la surface inférieure du moulage (en éléments dispersés).', 'Excroissance métallique, massive, irrégulière à la face inférieure du moulage, ayant l\'aspect d\'une cassure. Le moulage présente des inclu sions de sable dispersées surtout à la face supérieure.', 'Même mécanisme que A 222 mais avec désagrégation du sable détaché. Intervention éventuelle du phénomène de dilatation du sable (gale) et de serrage défectueux (deux couches de sable mal collées).', 'Voir A 222.', 4),
	(15, 'A224', 'Casse localisée ou dèche', 'None', '...dans les autres parties du moulage.', 'Excroissance massive irrégulière à aspect de cassure sur les faces latérales ou dans les angles du moulage. En général, on trouve sa contrepartie dans la région supérieure du moulage sous la forme d\'une inclusion de sable ou de manque de matière. Elle se situe dans une partie fragile du moule.', '- Voir défaut A 221 et A 222.\n- Mauvaise disposition des jets de coulée, le jet de métal liquide venant frapper les parois verticales de l\'empreinte. Mauvaise disposition du modèle ou de la plaque-modèle.\n- Mauvais lissage au plan de joint à la suite duquel un fragment de sable a été écrasé.', 'Voir défaut A 221 et A 222.\n\nProcéder aux réparations du moule dans des conditions qui permettent d\'éviter l\'écrasement à la fermeture.', 4),
	(16, 'A225', 'Gale d\'extrémité', 'None', '...sur de larges régions du moulage.', 'Excroissances compactes et irrégulières sur de larges parties du moulage avec une surface à l\'aspect de cassure comportant de fortes inclusions de sable.\n\nCe défaut apparaît dans les coins et angles rentrants du moulage ou sur des surfaces ayant une forme irrégulière, le plus souvent en même temps que les défauts D 230 (gale).', 'Contraintes de compression élevées dans les couches chaudes de la paroi supérieure de l\'empreinte produites par la dilatation de la silice; en même temps il peut se produire, derrière ces couches, une zone humide de condensation à faible résistance. Une couche chaude peut alors se trouver arrachée.', 'Augmenter la résistance à vert par les moyens suivants :\n    \n- plus forte proportion d\'argile (bentonite), meilleure qualité d\'argile (bentonite), meilleure préparation du sable (broyage), serrage optimal (éviter un serrage exagéré), refroidissement du sable.\n- diminution des contraintes de compression (défaut D 231), augmentation de la résistance à la traction du sable à l\'état surhumi difié.', 4),
	(17, 'A226', 'Noyau écrasé ou cassé', 'None', 'Excroissance dans une cavité formée par un noyau.', 'Excroissances massives et irrégulières dont la surface a l\'aspect d\'une cassure et qui se situent dans les parties creuses du moulage réalisées à l\'aide des noyaux. Le défaut s\'accompagne généralement, dans les régions supérieures du moulage, d\'inclusions compactes constituant la contre partie de l\'excroissance.', '- Partie faible dans le noyau : défaut de serrage ou manque de soin au noyautage ou boîte à noyau défectueuse.\n- Fêlure en cours de manutention : manutentions trop brutales, outillage de manutention défectueux.\n- Rupture au montage ou au remmoulage : mauvaise précision dimensionnelle, jeu insuffisant, support de noyau mal calibré, fermeture de moule mal guidée.\n- Rupture à la coulée : impact du jet de métal liquide sur le noyau trop violent, pression statique du métal liquide exagérée, armaturage insuffisant, supports inexistants ou mal disposés.', '.', 4),
	(18, 'A311', 'Resuage \nPour les fontes : goutte phosphoreuse ou diamant \nPour la fonderie de précision : bulle', 'None', 'Excroissance de forme plus ou moins sphériques sur les faces ou les arrêtes ou dans les angles rentrants.', 'Excroissances métalliques, à peu près sphériques à surface lisse. \n\nSur les surfaces libres des moulages (coulés à découvert ou centrifugés). \n\nLes «perles» ont généralement une composition chimique différente de celle du métal de base.\n\nEn moulage de précision, ce défaut apparaît, surtout dans les angles rentrants, les trous borgnes et les évidements.', '- Fonte\n\nL\'eutectique qui se rassemble au joint des grains en fin de solidification peut être expulsé vers les espaces libres (surfaces découvertes de la pièce ou intérieur des tuyaux centrifugés), sous l\'effet des pressions qui peuvent être engendrées par la graphitisation eutectique ou par le dégagement de solidifiée. gaz dissous ou par la contraction de la partie de pièce\nDans le cas de la fonte, ces gouttes sont généralement plus riches en phosphore que la masse de la pièce d\'où leur nom. Lorsque cette expulsion de liquide eutectique se produit à l\'intérieur d\'une soufflure ou autre défaut interne, le défaut est classé dans les inclusions à G 113.\nEn général il n\'est pas nécessaire de remédier à ces excroissances.\n\n- Alliages légers\n\nLe défaut peut se produire au cours d\'un traitement thermique dépassant la température du solidus. Vérifier les conditions du traitement thermique.\n\n- Alliages cuivreux\n\nDans les alliages cuivreux, c\'est généralement la pression due au dégagement de gaz dissous qui provoque le défaut qui de macroporosités. Le retrait de la partie solidifiée peut également jouer un rôle dans la formation du défaut. s\'accompagne alors de macroporosités. Le retrait de la partie solodifiée peut également jouer un rôle dans la formation du défaut.\n\nLe premier remède est d\'éviter le gazage.\n\n- Fonderie de précision à modèle perdu; tous métaux\n\nEn moulage de précision à modèle perdu, des bulles d\'air peuvent se loger dans les couches d\'enrobage ou d\'enduit si ces couches ne sont pas déposées correctement ou si l\'orientation des modèles sur la grappe se prête à cet emprisonnement de bulles. La couche d\'enrobage est rompue à la coulée et les bulles d\'air se remplissent de métal. Le remède consiste à soigner les opérations d\'enrobage.', 'Inclus dans Cause(s)', 5),
	(19, 'B111', 'Piqûres, Soufflures, Bouillonnement', 'None', 'Cavités rondes à parois généralement lisses, de grosseurs variées, isolées ou en groupes irréguliers dans toutes les régions du moulage.', 'Cavités à parois lisses, sensiblement sphéroïdales, souvent sans communication avec l\'extérieur (soufflures). Les plus grosses cavités sont le plus souvent isolées, les plus petites (piqûres) apparaissent en groupes de dimensions variées. Dans des cas particuliers, la masse peut être parsemée de soufflures ou de piqûres. La paroi intérieure des soufflures et des piqûres peut être brillante, être plus ou moins oxydée ou, lorsqu\'il s\'agit de fonte, être recouverte d\'une fine couche de graphite. Les défauts peuvent apparaître dans toutes les régions du moulage.', 'Les soufflures et les piqûres se produisent du fait de gaz inclus dans le métal en cours de solidification. Toutefois les gaz peuvent être à l\'origine d\'autres défauts que les défauts B 111.\n\n1/ Origine métallurgique (soufflures endogènes)\n\n- Teneur en gaz du bain trop élevée (matières premières, mode de fusion, atmosphère, etc.); le gaz dissous se dégage lors de la solidification.\n- S\'agissant d\'acier moulé, de fonte et de malléable formation d\'oxyde de carbone, par réaction du carbone avec l\'oxygène présent comme gaz ou à l\'état d\'oxyde. Possibilité d\'un agrandissement des soufflures d\'oxyde de carbone par diffusion d\'hydrogène ou exceptionnellement d\'azote.\n\n2/ Gaz provenant des matériaux constituant le moule ou les noyaux (soufflures exogènes)\n\n- trop forte humidité des moules ou noyaux; \n- agglomérants ayant une forte tendance à libérer des gaz;\n- trop forte proportion d\'additifs contenant des carbures d\'hydrogène; \n- noirs et couches ayant une trop forte tendance à libérer des gaz.\n\n3/ Gaz retenu mécaniquement (soufflures exogènes)\n\n- insuffisance d\'évacuation de l\'air et des gaz remplissant l\'empreinte;\n- insuffisance de perméabilité du moule et des noyaux;\n- entraînement d\'air par suite de turbulence dans le jet de coulée.', '- Prévoir largement l\'évacuation de l\'air et des gaz de l\'empreinte (évents et tirage d\'air); \n- augmenter la perméabilité du moule et des noyaux;\n- contrôler le système de coulée;\n- dans le cas du moulage étuvé, s\'assurer que l\'étuvage est suffisant; dans le cas du moulage à vert, contrôler l\'humidité du sable;\n- diminuer la proportion d\'agglomérant ou d\'additif ou changer d\'agglomérant ou d\'additif;\n- employer des noirs ou des couches à réaction réductrice;\n- engorger la coulée et réduire la hauteur de chute;\n- augmenter la pression statique par accroissement de la hauteur des jets de coulée.\n\npour l\'acier moulé :\n    \n- désoxydation suffisante;\n- éviter une réoxydation;\n- diminuer la teneur en hydrogène et en azote par une conduite appropriée de la fusion;\n- contrôler la température et le temps de coulée.\n\npour la fonte et la malléable :\n    \n- empêcher l\'introduction d\'oxyde et l\'oxydation du bain en évitant d\'employer des charges rouillées et en surveillant la fusion;\n- exceptionnellement contrôler la teneur en azote;\n- surveiller la teneur en aluminium, cause possible d\'introduction d\'hydrogène;\n- vérifier que la température de coulée n\'est pas trop basse.\n\npour les alliages non ferreux :\n    \n- ne pas fondre à une température trop élevée; éventuellement dégazer le bain. Les défauts dus aux gaz dissous sont exceptionnels dans les laitons et les alliages de magnésium.\n\nÉléments de diagnostic\n\nLe diagnostic, souvent difficile, peut s\'appuyer sur les éléments suivants :\n- Les cavités de grandes dimensions (bouillonnement) sont le plus souvent d\'origine exogène.\n- Les soufflures exogènes ont souvent des dimensions variables. Elles sont isolées ou en groupes irréguliers. \n- Les soufflures endogènes sont généralement de petite dimension régu lières et réparties d\'une façon homogène dans la pièce ou dans une partie de la pièce.\n- Dans les alliages ferreux, les soufflures d\'hydrogène ont des parois brillantes non oxydées, les soufflures d\'oxyde de carbone des parois bleutées, les soufflures d\'air entraîné des parois légèrement oxydées, grises.\n\nLe diagnostic n\'est pas toujours possible par le seul examen du défaut. Il requiert généralement une enquête et des essais puis un ajustement de certains des facteurs tenant à la métallurgie ou au moulage.', 6),
	(20, 'B112', 'Soufflures sur supports, sur pièces insérées', 'None', 'Comme ci contre, mais limitées au voisinage des pièces métalliques placées dans le moule', 'Soufflures de diverses dimensions à l\'intérieur d\'un moulage, isolées ou groupées, au voisinage immédiat de supports de noyaux, refroidisseurs ou pièces insérées.', '- Pièces métalliques humides ou oxydées.\n- Absence de protection métallique telle que zingage ou cuivrage. \n- Condensation sur les pièces métalliques par suite de la différence de température entre ces pièces d\'une part, le moule et les part. noyaux d\'autre\n- Pièces insérées ou refroidisseurs souillés, huileux ou recouverts de poteyage susceptible de libérer des gaz.', '- N\'employer que des pièces insérées galvanisées ou cuivrées.\n- Bien nettoyer, sécher (éventuellement réchauffer) toutes les pièces métalliques avant de les placer dans le moule.\n- Éviter que le moule ou les noyaux aient une température supérieure à celle des pièces métalliques destinées à être insérées dans le moule.\n- Enduire les refroidisseurs d\'huile de lin et les sécher dans une étuve à noyaux; dans le cas de moulage étuvé, mettre une couche de noir sur les surfaces ainsi préparées.\n- Utiliser des refroidisseurs dont la surface de contact est cannelée.', 6),
	(21, 'B113', ' Soufflures de scories', 'None', 'Comme B 111, mais accompagnées d\'inclusions de scories (G 112).', 'Même aspect que le défaut B 111 (soufflures) mais toujours accompagné d\'inclusion de scorie (défaut G 122) généralement localisé à la partie supérieure des moulages.', '- Réactions d\'oxydation au sein du métal liquide donnant naissance à des oxydes liquides ou solides, puis à des gaz (soufflures). \n- Réactions du métal liquide et de ses oxydes avec le réfractaire des appareils de fusion, des poches ou avec les matériaux constituant le moule.', 'Voir B 111, remèdes aux phénomènes d\'origine métallurgique.\n\nVoir bibliographie G 122.', 6),
	(22, 'B121', 'Soufflures superficielles Refus', 'None', '...de grosseurs diverses, isolées ou en groupes, le plus souvent superficielles, avec des parois brillantes.', 'Cavités à parois le plus souvent arrondies et en général lisses, souvent sous forme de bulles aplaties avec des coins arrondis ou anguleux, à la surface du moulage, isolées ou en groupe.\n\nLes cavités sont parfois ouvertes (refus ouvert) mais le plus souvent situées sous une mince couche de métal (refus fermé) et ne sont visibles qu\'après grenaillage ou usinage ou bien apparaissent au décochage comme des régions brillantes.', '- Insuffisance de perméabilité du moule ou des noyaux.\n- Coulée trop lente ou trop froide.\n- Insuffisance de hauteur des jets et masselottes. \n- Toutes les causes de B 111 (soufflures).\n- En coulée sous pression; entraînement d\'air, trop haute température du moule, éventuellement en conjonction avec une température du métal trop élevée; vaporisation du produit lubrifiant.\n- L\'air ou les gaz ont pu encore s\'élever dans le sein du métal liquide, mais non quitter l\'empreinte, faute d\'issue, par manque de perméabi lité du moule ou à cause d\'une couche de métal déjà solidifiée.', '- Parer aux causes possibles \n- En fonderie sous pression:\n    \n- ajuster la température du moule et du métal, \n- lubrifier modérément,\n- introduire une régulation de température du moule, employer le vide.', 7),
	(23, 'B122', 'Soufflures d\'angle Soufflures retassures \nEffet Léonard', 'None', '...dans les angles rentrants des moulages atteignant souvent des régions profondes.', 'Cavités dans les angles rentrants d\'un moulage se développant vers l\'in térieur. Les arêtes sont en général arrondies à la différence du défaut B 212 (retassure de coin ou d\'angle rentrant).', 'L\'échauffement du sable donne lieu à des phénomènes de dilatation, vaporisation, déshydratation, distillation, etc., générateurs de gaz dont la pression, qui s\'ajoute à la pression atmosphérique peut être suffisante pour permettre leur pénétration dans la pièce en cours de solidification par les points singuliers de la surface qui se solidifient en dernier lieu, particulièrement les angles rentrants.\n\nLe défaut peut être favorisé par la contraction de solidification ou, dans le cas des fontes grises et G.S., par l\'expansion de la croûte solidifiée due à la graphitisation.\n\nLorsque ces derniers facteurs sont prépondérants, le défaut doit être de préférence classé à B 212 (retassure d\'angle) et les remèdes recherchés à cette rubrique.', 'Lorsque l\'effet de gaz est prépondérant (défaut B 122) la cavité et les arêtes sont arrondies alors qu\'elles sont rugueuses et généralement dendritiques pour les retassures d\'angles B 212.\n\n- Prévoir des congés aux angles rentrants.\n- Diminuer l\'emploi des produits susceptibles de dégager des gaz à chaud. Améliorer la perméabilité du sable et le système de tirage d\'air.\n- Disposer un refroidisseur ou un noyau externe dans les parties sujettes au défaut.\n- Augmenter la pression du métal liquide, nourrir.', 7),
	(24, 'B123', 'Piqûres superficielles', 'None', 'Petites porosités (cavités) à la surface des moulages, apparaissant dans des régions plus ou moins étendues.', 'Petites cavités quelquefois de la dimension d\'une tête d\'épingle situées à la surface d\'un moulage, en colonies plus ou moins étendues, apparaissant sous deux formes:\n\n- Cavités généralement sphériques qui disparaissent à l\'usinage après une passe de 1 à 2 mm (piqûres superficielles).\n- Dans une section, ou une cassure il apparaît au voisinage de la surface, des cavités en forme de flamme, de massue ou de gouttes, dont la paroi, lorsqu\'il s\'agit de fonte, est généralement recouverte d\'une fine couche de graphite. Si ces cavités n\'apparaissent qu\'après usinage d\'une surface qui était apparemment saine, ou après traitement thermique, ou encore si les trous qui apparaissent déjà sur la surface brute voient leur diamètre augmenter à l\'usinage, il s\'agit de piqûres sous-cutanées. Le grand axe de ces soufflures allongées et à parois lisses est toujours perpendiculaire à la surface du moulage et se situe entre les grains de cristallisation décelables à l\'attaque macrogra phique. La couche où sont situées ces piqûres ne dépasse pas en général 4 mm d\'épaisseur, le reste de la section étant sain.\n\nSe produit\n\ndans l\'acier moulé :\n    \n- surtout dans les régions des moulages ayant des épaisseurs de l\'ordre de 15 à 30 mm,\n\ndans la fonte et la malléable : \n    \n- surtout dans les régions minces,\n\nen coulée à vert:\n    \n- au voisinage des surfaces formées par des noyaux exécutés à l\'aide d\'agglomérants organiques.\n\n\nFormation\n\n- Piqûres superficielles\nRéactions avec le carbone de scories riches en oxyde de fer et non saturées en silice, d\'où production d\'oxyde de carbone, qui se dégage en piqûres superficielles. Celles-ci pouvant être agrandies par un dégagement d\'hydrogène diffusé.\n\n- Piqûres sous-cutanées\nOxydation superficielle du jet de métal pénétrant dans l\'empreinte par réaction avec l\'oxygène de l\'atmosphère du moule ou avec les constituants du matériau de moulage.\nRéaction des oxydes formés avec le carbone du métal liquide et dégage ment d\'oxyde de carbone. Ces réactions, dans les zones voisines de la surface provoquent des cavités pouvant se développer sous l\'effet du dégagement d\'hydrogène.\n\nLorsque la pression gazeuse atteint une valeur suffisante il se produit entre les cellules en cours de formation au voisinage de la surface, dans le liquide intercristallin, de minces canaux qui partent du voisinage de la surface sur laquelle ils débouchent dans certains cas.\n', '- Métallurgiques :\n    \n- teneur excessive du bain en oxygène et éventuellement en hydrogène (du fait de la charge ou du processus de l\'élaboration);\n- teneur élevée en éléments ayant une forte affinité pour l\'oxygène, par exemple le titane et l\'aluminium éventuellement contenus dans les produits inoculants; \n- température excessive. \n- rapport manganèse/silicium défavorable et/ou haute teneur en soufre, fonte grise et malléable.\n\n- Relatives au matériau de moulage :\n    \n- trop forte humidité du moule et/ou des noyaux,\n- s\'agissant d\'agglomérants organiques : trop forte teneur en urée.', 'Moulage :\n    \n- Diminuer l\'humidité des mélanges pour moules et noyaux; \n- Employer des agglomérants pour moules et noyaux comportant une teneur aussi faible que possible en urée.\n\nMétallurgie :\n    \n- Acier moulé\n\n- Maintenir la teneur du bain en hydrogène aussi basse que possible, ce qui peut être réalisé en faisant travailler le bain de façon intensive pendant l\'affinage. \n- Désoxyder soigneusement le bain à l\'aide de manganèse et de silicium et, à la coulée, à l\'aide d\'aluminium.\n- Éviter de trop longs canaux de coulée.\n- Faire les jets de coulée et les canaux de coulée en chamotte réfractaire.\n- Couler rapidement mais sans turbulence.\n\n- Fonte\n\n- Améliorer la fonte en veillant à sa composition et à son élaboration (éviter des charges rouillées ou sales, augmenter la teneur en sili cium, diminuer la teneur en manganèse).\n- Éviter l\'introduction d\'éléments avides d\'oxygène, surtout le titane et l\'aluminium dans le ferro-silicium et dans les produits d\'inoculation.\n- Abaisser la température de coulée. Utiliser des attaques en pression avec des canaux aussi courts que possible.', 7),
	(25, 'B124', 'Défauts en virgules Retassures dispersées', 'None', 'Petites cavités étroites en forme de criques apparaissant sur des faces ou le long d\'arrêtes en général seulement après l\'usinage.', 'INTÉRESSE ESSENTIELLEMENT LES FONTES.\n\nCavités étroites ayant la forme de déchirures généralement perpendicu laires à la surface du moulage. Leur profondeur peut aller jusqu\'à 2 cm. La surface intérieure des cavités est dendritique.\n\nElles sont souvent accompagnées d\'un grossissement des lamelles de graphite.', '- Trop basse teneur en carbone.\n\n- Trop forte teneur en azote (en général au-dessus de 100 ppm).\nCe facteur a d\'autant plus d\'influence que les pièces sont plus épaisses. C\'est souvent la conséquence d\'une proportion élevée d\'acier dans la charge, particulièrement d\'acier Thomas, ou d\'une élaboration au four à arc.\n\n- Moule insuffisamment rigide.\n\nLe dégagement d\'azote a lieu pendant la solidification ce qui provoque la dispersion de la retassure.', '- Diminuer la teneur en azote.\n- Diminuer la proportion d\'acier de la charge.\n- Élaborer le métal dans un autre appareil que le four à arc (four induction - cubilot, etc.). \n- Fixer l\'azote sous forme de nitrure à l\'aide de titane ou d\'aluminium. \n- Étuver les moules.', 7),
	(26, 'B211', 'Retassure ouverte Retassure externe', 'None', 'Cavité en forme d\'entonnoir. Parois en général garnies de dendrites.', 'Cavité ouverte ou fermée, à parois généralement rugueuses, souvent dendritiques (mais lisses pour certains alliages eutectiques), unique ou plus ou moins dispersée, localisée dans les zones se solidifiant en dernier lieu ou encore au contact des angles rentrants de la pièce, des noyaux ou à proximité des attaques.', 'La cause principale est la contraction de volume subie par le métal: \n    \n- a l\'état liquide, dans le moule, jusqu\'au début de la solidification, \n- en passant de l\'état liquide à l\'état solide.\n\nDes causes accessoires peuvent éventuellement agir sur l\'importance, l\'aspect et la localisation du défaut. Ce sont :\n\n- Les gaz dégagés par le moule et la pression atmosphérique (effet Léonard). \n- L\'effet, sur les parties en cours de solidification, du retrait solide de parties déjà solidifiées (crique de retassure). \n- Des dégagements gazeux au sein du métal liquide (soufflures endogènes, retassures dispersées).\n- Les déformations du moule sous l\'effet de la dilatation due à son élévation de température ou de la pression du métal (pression statique ou gonflement de solidification).\n\nCas particulier des fontes grises et G.S.\n\nLa contraction de solidification se manifeste dans tous les alliages de fonderie.\n\nToutefois, dans le cas des fontes grises et G.S., le gonflement dû à la formation du graphite eutectique compense l\'effet des contractions pour donner en fin de compte suivant les teneurs croissantes en graphite eutectique :\n\n- une contraction réduite, \n- une absence de contraction,\n- un gonflement.\n\nDans ce dernier cas, le plus fréquent, l\'expansion subie par les zones périphériques de la pièce, solidifiées en premier lieu, crée dans les zones centrales un vide, avec déplacement de liquide. Ce vide ne sera pas comblé au moment de la solidification du liquide résiduel car l\'édifice cristallin très développé s\'opposera alors au cheminement de ce liquide.\n\nIl résulte de ces phénomènes des cavités qui ont l\'apparence de retassures mais dont les causes sont différentes; ce qui implique des remèdes en partie différents.\n\nDiagnostic\n\nUn indice sûr est le gonflement de la pièce avec forçage du moule. Les dimensions sont augmentées d\'une façon sensible, le poids des pièces défectueuses est généralement supérieur à celui des pièces bonnes en dépit des cavités.\n\nTerminologie\n\nLe mot retassure quoique très généralement utilisé est impropre dans ce cas et ne s\'applique qu\'aux retassures authentiques des fontes blanches, truitées ou à bas carbone.\n\nNous recommandons le terme « fausse retassure >>.', 'Remèdes aux retassures. Cas général\n\n- Tracé \n\n- S\'astreindre à constituer les pièces de régions dont les modules soient sensiblement égaux, ou aillent en croissant vers les masselottes (solidification dirigée). Il s\'agit bien entendu de modules corrigés suivant les formules en usage. \n- Modifier éventuellement le tracé par addition de surépaisseurs qui seront, si c\'est nécessaire, enlevées à l\'usinage. \n\n- Métal\n\nUtiliser un alliage ne présentant qu\'une contraction de solidification faible ou nulle. La fonte grise ou la fonte G.S. sont les seuls alliages de fonderie susceptibles de se prêter, dans une certaine mesure à un tel réglage par variation de la teneur en graphite eutectique.\n\n- Coulée\n\nLimiter, dans la mesure du possible, la température de coulée afin de réduire la contraction à l\'état liquide.\n\n- Alimentation\n\n- Masselottes disposées de façon à alimenter les zones de haut module, comportant une réserve de métal liquide en quantité suffisante et pourvues d\'un tracé ou de dispositifs permettant un libre passage du métal liquide jusqu\'à la fin de la solidification.\n- Emploi de produits exothermiques.\n- Nombre de masselottes suffisant, compte tenu des zones d\'action propres au métal à alimenter et du degré de compacité exigé. \n- Utilisation éventuelle de refroidisseurs externes ou internes, pour créer des effets d\'extrémité ou pour modifier les modules.\n- Addition éventuelle de nervures de refroidissement.\n\nRemèdes particuliers à la «fausse retassure» des fontes grises et des fontes G.S.\n\n- Réaliser une fonte voisine du point où il n\'y a ni contraction ni retrait, soit en augmentant la vitesse de refroidissement, soit en supprimant, si c\'est possible, l\'inoculation (diminution du nombre de cellules eutec tiques). Intérêt du contrôle par l\'analyse thermique.\n- Si la fonte est élaborée au four électrique, contrôler avec précision les températures, la durée des opérations et le processus des additions (nature, poids, instant). \n- Augmenter la rigidité du moule soit par serrage plus intense des moules à vert, soit par passage au sable étuvé ou au sable durci ou à la coulée en coquille. \n- Éventuellement masselotter, en choisissant un rapport de modules réduit (par exemple 0,6).', 8),
	(27, 'B212', 'Retassure d\'angle', 'None', 'Cavité à arêtes aiguës dans les angles des pièces épaisses ou aux attaques de coulées.', 'Cavité débouchant dans des angles rentrants du moulage, aux attaques de coulées ou d\'une façon plus générale aux points singuliers de la surface se caractérisant par une solidification tardive. Elle peut se prolonger vers l\'intérieur par des cavités isolées ou par des zones poreuses.\n\nLes parois de ces cavités sont rugueuses, le plus souvent dendritiques sauf dans certains alliages eutectiques.', 'Mêmes causes que la retassure ouverte (voir B 200) mais avec intervention possible de la pression atmosphérique et de la pression des gaz dégagés par le moule. \n\nLe simple examen du défaut n\'est généralement pas suffisant pour formuler un diagnostic. L\'influence respective des principaux facteurs : contraction de solidification, expansion (pour les fontes), gaz et atmosphère ne peut être précisée dans chaque cas particulier que par des observations en cours de fabrication et par des essais.', 'Voir B 200.\n\nPlus particulièrement :\n    \n- Améliorer le tracé de la pièce par des changements de section progres sifs, des congés dans les angles, des nervures de refroidissement.\n- Placer un refroidisseur dans l\'angle sujet au défaut ou au contraire, l\'alimenter si la forme de la pièce s\'y prête.\n- Utiliser une <<masselotte atmosphérique » pour rétablir la pression atmosphérique dans la cavité de retassure en voie de formation et permettre son alimentation.\n- Améliorer la perméabilité du sable et les tirages d\'air dans les angles (effet Léonard).\n- Prendre des dispositions permettant le libre retrait des parties de la pièce solidifiées en premier lieu et susceptible de ««<tirer» sur les angles des parties massives.', 8),
	(28, 'B213', 'Retassure de noyau', 'None', 'Cavité en communication avec un noyau', 'Cavité comportant tous les caractères d\'une retassure (voir B 200) mais communiquant avec un noyau, généralement dans une partie massive de la pièce.', 'Même mécanisme que B 212 (retassure d\'angle). C\'est le noyau, dans ce cas, qui sert de passage aux gaz ou à l\'air (pression de l\'atmosphère) jus qu\'à la cavité de retassure en cours de formation.', 'Voir B 200 et B 212.', 8),
	(29, 'B221', 'Retassure interne', 'None', 'Cavité de forme irrégulière. Parfois souvent garnies de dendrites.', 'Caractères généraux de la retassure (B 200) mais sans communication avec l\'extérieur. Généralement vers le haut des parties massives de la pièce ou dans les raccordements de parois.', 'Voir B 200.\n\n- Contractions de solidification et alimentation insuffisante des régions épaisses.\n- Dans le cas des fontes grises riches en graphite eutectique et coulées en moule de rigidité insuffisante: gonflement à la solidification avec formation de «fausses retassures» dans les parties épaisses (voir B 200 - fontes).', 'Voir les groupes de défauts B 200 et B 300.\n\n- Lors du tracé, éviter les accumulations de matière. Veiller à l\'alimentation des parties massives.\n- S\'il s\'agit de fonte à haute teneur en graphite eutectique, veiller à la stabilité dimensionnelle du moule (peu de bentonite et d\'eau, soigner le serrage).\n- Utiliser des refroidisseurs internes ou externes.\n- Dans le cas de coulée sous pression, ajuster la température du métal et celle du moule. Veiller à l\'évacuation d\'air.', 9),
	(30, 'B222', 'Retassure axiale', 'None', 'Cavité ou région poreuse dans le plan médian du moulage.', 'Cavité ou région poreuse dans le plan médian du moulage ou des parties de moulages ayant la forme de plaques.', 'Une couche de métal se solidifie rapidement au contact du moule, surtout s\'il s\'agit de sable vert ou d\'un moule métallique, mais la partie située dans le plan médian ne se solidifie qu\'avec un certain retard et subit l\'effet du retrait liquide et de la contraction de solidification.\n\nCet effet est surtout marqué si l\'alliage a été coulé à une température un peu trop élevée pour l\'épaisseur considérée.', '#NOM?', 9),
	(31, 'B311', 'Porosités, Micro-retassures', 'None', 'Régions poreuses visibles à l\'oeil nu.', 'Ce défaut peut être révélé soit par un essai d\'étanchéité négatif, soit examen à l\'oeil nu ou à l\'aide d\'appareil grossissant des parties internes de la pièce découvertes par l\'usinage ou mis à nu par essai destructif. Il peut également correspondre à l\'extérieur de la pièce à des défauts secondaires dans les revêtements (émaillage, galvanisation, etc.) ou à des dépressions superficielles (poquettes). \n\nIl se présente sous un aspect spongieux, parfois dendritique ou sous forme de petites cavités juxtaposées.\n\nLe défaut est généralement localisé dans les parties se solidifiant en dernier lieu (masses, raccords de parois, angles rentrants, noyaux, attaches des jets et masselottes). Il accompagne parfois et prolonge les défauts B 200 (retassure).\n\nIl affecte de préférence les alliages à grand intervalle de solidification (voir B 200-retassures).', '- Changement de volume à la solidification.\n\n- Contraction de solidification et défaut d\'alimentation des parties défectueuses (microretassures). \n- Dans le cas des fontes riches en graphite eutectique, expansion à la solidification avec déplacement de liquide eutectique entre les cristaux solidifiés (fausse retassure).\n- Dans le cas des fontes phosphoreuses, contraction à la solidification du liquide eutectique, riche en phosphore, dans les parties épaisses des pièces. Particulièrement sensible si la fonte phosphoreuse contient du chrome et du molybdène.\n\n- Gaz (voir B 100 - soufflures).\n\n- Dégagements gazeux en cours de solidification : gaz dissous dans le métal ou produits de réactions internes. \n- Dégagements gazeux des matériaux de moulage sous l\'effet thermique ou chimique du métal liquide. \n- En coulée, sous pression, entraînement d\'air.', 'Le diagnostic est généralement difficile en raison du grand nombre de facteurs, de leurs origines très diverses et souvent de leur interdépendance. De plus, certains de ces facteurs sont parfois intangibles, la composition du métal par exemple.\n\nUn examen attentif des pièces (aspect, dimensions, position des défauts) des observations de la fabrication, des contrôles en laboratoire et des essais en usine sont alors nécessaires.\n\n1/ Microretassures\n\n- Améliorer le tracé : variations d\'épaisseur progressives, éviter les angles rentrants et les masses difficiles à alimenter.\n- Modifier la composition du métal dans le sens donnant une diminution de l\'intervalle de solidification.\n- Établir le système de coulée, de masselottage et de refroidisseurs de façon à réaliser une solidification correctement dirigée. Respecter les règles relatives aux zones d\'action, aux modules, à la bonne commu nication et aux réserves de métal liquide dans les masselottes. Augmenter le nombre d\'attaques.\n\nDans le cas de la fonte grise ou de la fonte G.S.: \n- Chercher à réaliser une fonte dans laquelle les phénomènes de contraction et de gonflement se compensent soit :\n\n- S\'il y a contraction (retassure) augmenter les teneurs en carbone et silicium dans la mesure où les caractéristiques mécaniques requises le permettent, avec rapport C/Si aussi élevé que possible.\n- S\'il s\'agit de gonflement (fausse retassure) diminuer la teneur en graphite eutectique par abaissement du taux des éléments graphi tisants (carbone, silicium), addition d\'éléments gammagènes ou augmentation de leur taux (manganèse, nickel, cuivre, étain, azote) et augmentation de la vitesse de solidification.\n\n- Diminuer le nombre de cellules eutectiques par la surchauffe, la sup pression de l\'inoculation, ou l\'emploi d\'un inoculant n\'agissant pas sur le nombre de cellules.\n- Diminuer la teneur en phosphore.\n- Abaisser la température de coulée.\n- Augmenter la rigidité du moule soit : moule à vert serré plus énergi quement, moule séché ou durci, coquille. Ce dernier facteur (la rigidité du moule) est l\'un des plus efficaces lorsqu\'il s\'agit de porosité du type «fausse retassure » affectant des fontes grises.\n\nDans le cas des alliages non ferreux :\n- Choisir si possible des alliages à faible intervalle de solidification moins sensibles à la porosité.\n- Affiner le grain s\'il s\'agit d\'alliages Al-Mg ou Al-Cu-Ti ou d\'alliages de Mg.\n- Éviter les inclusions non métalliques en suspension dans le bain.\n\n2/ Porosités gazeuses\n\n- Porosités endogènes : \n    \n- Désoxydation poussée du bain dans le cas de l\'acier.\n- Dans le cas du bronze à l\'étain ou du bronze-étain-zinc, éviter les teneurs élevées en S (produits de réaction gazeux).\n- Dégazage du bain.\n\n- Porosités exogènes :\n    \n- Diminuer dans les sables de moulage et de noyautage les proportions d\'eau, d\'agglomérants et d\'additifs divers ou utiliser des produits donnant des dégagements gazeux moins importants ou plus tardifs.\n- Même observation pour les couches et produits contre le collage. . Améliorer la perméabilité des sables et les tirages d\'air.\n- Introduire dans les sables de moulage ou de noyautage des inhibiteurs par exemple pour les alliages de magnésium: soufre et acide borique.\n\n- Dans tous les cas l\'augmentation de la pression statique du métal liquide, par élévation du niveau des coulées, joue dans un sens favorable à l\'élimination des défauts.\n\n- Inclusions d\'air en coulée sous pression : \n    \n- Ajuster le volume de la chambre à la quantité de métal à couler.\n- Prévoir l\'évacuation d\'air de la chambre.', 10),
	(32, 'C111', 'Cassure à froid', 'None', 'Aspect de cassure normale avec quelquesfois des traces de matage.', 'Solution de continuité, souvent à peine visible, car en général la pièce n\'est pas séparée en plusieurs fragments. Le tracé de la pièce ne permet pas de supposer qu\'il y ait eu effet de contrainte lors du refroidissement', 'Détérioration du moulage par suite de maladresse au décochage, à l\'ébarbage ou lors de manutentions.\n\nContrainte exagérée exercée à l\'ébarbage ou à l\'usinage vitesse de coupe, profondeur de passe ou avance exagérées, excès de serrage.', 'Soins apportés aux opérations énumérées ci-dessus.', 11),
	(33, 'C121', 'Cassure à chaud', 'None', 'Cassure oxydée entièrement ou sur les bords.', 'Solution de continuité souvent à peine visible, car la pièce ne se sépare généralement pas en plusieurs parties. Les parois de la cassure peuvent être colorées par suite de l\'oxydation en surface. Le tracé de la pièce ne permet pas de supposer qu\'il y ait eu effet de contrainte.', 'Détérioration à chaud, par suite d\'un décochage prématuré ou trop brutal.', '- Soins au décochage et à la manipulation du moulage encore chaud. \n- Refroidissement suffisant de la pièce dans le moule. \n- En moule métallique : démoulage non prématuré et bien rectiligne, utilisation éventuelle d\'éjecteurs.', 12),
	(34, 'C211', 'Tapure à froid', 'None', 'Solution de continuité à bords écartés, dans des régions sensibles aux tensions intéressant généralement toute la section; métal non oxydé.', 'Solution de continuité sous forme d\'une fissure visible. Les bords à angle vif délimitent une cassure de largeur constante qui en général s\'étend sur toute la section. Le grain de la cassure présente l\'aspect habituel de celui d\'une pièce cassée à froid. S\'il est oxydé (alliages ferreux et cui vreux), il s\'agit d\'une tapure à chaud C 222.\n\nS\'agissant de malléable, la tapure est souvent apparente avant le traitement de malléabilisation. \n\nCe défaut se produit aux endroits sujets à des tensions, c\'est-à-dire dans les parties de la pièce solidifiées en dernier lieu, les parties solidifiées en premier étant au contraire soumises à des compressions.', '- En tout premier lieu le tracé qui crée de grandes différences de refroi dissement.\n- Le système de coulée et de masselottage créant ou accentuant l\'aniso thermie au refroidissement.\n- Effort ou choc extérieur, s\'ajoutant à l\'effet des tensions, au cours du décochage, des manutentions, de l\'ébarbage, de l\'usinage ou en service. \n- Insuffisance de la résistance à la traction ou de la capacité de déformation de l\'alliage.', '- Tracé correct.\n- Attaques, masselottes et refroidisseurs favorisant un refroidissement isotherme.\n- Refroidissement lent dans le moule accompagné éventuellement d\'un dégagement rapide des parties massives, par exemple gros moyeux et leurs noyaux d\'alésage.\n- Soin au décochage. \n- Utilisation de marteaux « amortis» en alliage léger, cuivre, caoutchouc dur, bois dur. \n- Limitation du cheminement des tapures admissibles par un trou percé à leur extrémité.\n- Pour les pièces sujettes aux tapures à froid, traitement de stabilisation comportant une mise à température et un refroidissement lent par exemple pour la fonte grise, chauffage et refroidissement à 50°C : heure et maintien à 550°C pendant 2 heures + 1 heure par centimètre d\'épaisseur.', 13),
	(35, 'C221', 'Crique', 'None', 'Solution de continuité de parcours irrégulier dans les région sensibles aux tensions. \nOxydation de la surface de séparation avec éventuellement structure dendritique fine.', 'Fissures intercristallines plus ou moins profondes dont le parcours est irrégulier. La cassure présente parfois une structure dendritique fine et un aspect oxydé.\n\nCe défaut apparaît le plus souvent dans les régions se solidifiant en dernier lieu et dans lesquelles des contraintes se produisent (par exemple changements de section, angles rentrants).', '- En principe:\nL\'alliage en cours de solidification, à une température voisine de celle\ndu solidus, a subi une contrainte ou une déformation.\n\n-En général :\n\n    Retrait contrarié par suite d\'un tracé défectueux : \n        \n- De fortes différences d\'épaisseur.\n- Passages trop rapides d\'une épaisseur à une autre.\n- Moulage trop ramifié.\n\n    \n    Retrait contrarié pour des raisons tenant au moule :\n        \n- Matériaux de moulage et de noyautage trop rigides.\n- Surfaces de moule rugueuses.\n- Vitrification de sable.\n\n    Allongement ou déformation du moule : \n        \n- Sable ou parties métalliques échauffées.\n\n- S\'agissant de moulage par gravité ou sous pression: \n- Maintien trop prolongé de la pièce dans le moule.\n- Retrait contrarié par suite d\'une dépouille insuffisante. \n- Moule ouvert trop tôt, pièce endommagée à l\'extraction. \n- Criques à l\'extraction des noyaux du fait d\'un manque de précision d\'ajustage.\n- Mauvaise disposition des éjecteurs provoquant des contraintes de\nflexion. \n- Création de points chauds par suite d\'une température de coulée\ntrop élevée ou par effet d\'arête de sable. \n- Alimentation en métal liquide insuffisante.\n\n- Causes métallurgiques :\n    \n    Certains alliages peuvent être sensibles à la crique du fait d\'une composition incorrecte.\n- Acier moulé : \nTeneur en soufre ou en aluminium trop élevée.\n\n- Malléable :\nRetrait trop important par suite de teneurs insuffisantes en silicium et surtout en carbone, combinées avec une trop haute temperature de coulée.\n\n- Fonte et surtout fonte coulée en coquille (cylindres de laminoir):\nTeneur en phosphore insuffisante.\n\n- Bronze à l\'étain : Ségrégation de plomb.', '- Remédier aux causes générales indiquées ci-dessus.\n- Disposer des nervures de refroidissement ou des refroidisseurs externes aux régions menacées de tensions et où un retard de solidification est à prévoir.\n\n- Métallurgie:\n    \n- En acier moulé : désulfuration (moins de 0,02% S) et désoxydation suffisante. Diminuer la durée de la coulée.\n- En alliage léger : affinage du grain.', 14),
	(36, 'C222', 'Tapure à chaud, de trempe', 'None', 'Rupture après solidification complète, en cours de refroidissement ou à l\'occasion d\'un traitement thermique', 'Solution de continuité sous la forme d\'une crevasse visible à l\'œil nu. Les bords aigus délimitent une cassure nettement visible et de largeur régulière superficielle ou intéressant toute la section. Les parois de la cassure. par suite d\'oxydation à chaud, sont colorées dans le cas des alliages ferreux.', '#NOM?', '- Modification des conditions de trempe: température et nature du bain adoucissement de ces conditions lorsqu\'il s\'agit de pièces compliquées.\n- Emploi d\'alliages qui ont une faible vitesse critique de trempe, modi fication du tracé (régularisation des épaisseurs).', 14),
	(37, 'C311', 'Reprise', 'None', 'Séparation complète ou partielle souvent dans un plan vertical.', 'Solution de continuité à bords arrondis. Ce défaut, nettement caractérisé, intéresse une partie ou la totalité de la section de la pièce et peut à la limite se réduire à un léger sillon à bords arrondis. Il peut être accompagné d\'arêtes mal venues (voir défaut E 111, mal venu ou défaut E 121, manque). Il se produit sur les grandes surfaces ou dans les régions des pièces d\'accès difficile pour le métal liquide ou dans la zone de rencontre de deux nappes de métal liquide.', '- Coulabilité insuffisante.\n- Coulée trop lente.\n- Dégagement d\'air insuffisant.\n- En coulée sous pression : mauvaise soudure de courants de métal fortement refroidis, qui ont une histoire thermique différente (ce qui se manifeste aussi par une différence de structure).', '- Couler plus chaud.\n- Améliorer la coulabilité de l\'alliage.\n- Accroître la régularité ou la vitesse de remplissage de l\'empreinte par une meilleure conception des attaques.\n- Ménager des dégagements d\'air suffisants. \n\nEn moule métallique :\n    \n- Ajuster la température du moule et celle du métal (en général les élever). \n- Réchauffer certaines parois du moule, ou mieux régler leur température. \n- Mettre au point le système d\'attaque. \n- Vérifier le poteyage (conductibilité).', 15),
	(38, 'C321', 'Coulée interrompue', 'None', 'Séparation du moulage dans un plan horizontal', 'Solution de continuité qui se présente comme un joint visible dans un plan horizontal. Les deux parties du moulage sont séparées ou soudées seu lement par endroits. La partie inférieure présente des arêtes arrondies.', '- Irrégularités de coulée pouvant conduire à une interruption du remplissage de l\'empreinte.\n- Quantité de métal insuffisante et complément tardif de métal liquide avec solidification prématurée de la surface du métal qui est dans l\'empreinte au moment de l\'interruption de la coulée.', '#NOM?', 16),
	(39, 'C331', 'Reprise sur support de noyau ou autre pièce insérée', 'None', 'Solution de continuité localisée au voisinage d\'une pièce insérée.', 'Solution de continuité localisée au voisinage de la pièce insérée : support de noyau, tube inséré, refroidisseur interne, etc.', 'Mauvaise soudure entre la pièce insérée et le métal par suite de solidifi cation prématurée ou de refroidissement excessif du métal liquide au contact de cette pièce.', '- Plus haute température de coulée. \n- Amélioration de la coulabilité.\n- Modification des attaques en vue d\'accélérer le remplissage de l\'empreinte.\n- Dimensionnement et disposition corrects des pièces à insérer. \n\nDans l\'application de ces mesures, il faut évidemment veiller à éviter la fusion des pièces insérées.', 17),
	(40, 'C411', 'Cassure conchoïdale ou de "sucre candi"', 'None', 'Séparation le long des joints de grains de cristallisation primaire', 'La cassure présente des facettes lisses légèrement incurvées comme celles du sucre candi.', 'Ce défaut se produit lorsque les teneurs en aluminium et en azote sont trop élevées et que le nitrure d\'aluminium précipite aux joints de grains.', 'Limiter le taux d\'addition d\'aluminium à la valeur juste nécessaire pour assurer le calmage. Éventuellement fixer l\'azote par le titane ou le zirconium (veiller aux inconvénients en ce qui concerne les caractéristiques mécaniques).', 18),
	(41, 'C412', 'Corrosion inter-granulaire', 'None', 'Criques en réseau sur tout la section (défaut du zinc coulé sous pression)', 'Détérioration des caractéristiques mécaniques par suite de fissures en réseau qui occupent toute la section du moulage. Gonflement, voile des moulages et fissuration de la surface. Ce défaut peut n\'apparaître qu\'à long terme.', 'Emploi d\'un alliage de zinc non conforme à la norme et contenant des impuretés telles que l\'étain, le plomb, le cadmium. Décohésion de l\'alliage le long des joints de grains.', 'Emploi exclusif d\'alliages de zinc affinés, purs et contrôlés. La teneur en magnésium doit rester à l\'intérieur des limites fixées par la norme (de préférence près de la limite supérieure).', 18),
	(42, 'D111', 'Peau de crapaud Friasses', 'None', 'Plissement sur des régions assez importantes de la surface.', 'Plissements irréguliers répartis sur la surface du moulage. Avec l\'acier moulé le plus souvent sur les faces peu épaisses et horizontales.', '#NOM?', '.', 19),
	(43, 'D112', 'Peau d\'éléphant', 'None', 'Surface plissée ou sillonée par des anfractuosités en réseaux (fonte G.S.).', 'Surface irrégulièrement grenue ou plissée souvent avec des sillons un peu plus profonds disposés en réseau. \n\nAspect parcheminé.\n\nSe rencontre principalement à la surface supérieure horizontale de moulages épais.', 'Les composés résultant du traitement au magnésium, par exemple oxyde de magnésium, sulfure de magnésium, etc., apparaissent en général sous forme de pellicules plus ou moins dispersées qui, dans la poche, ne montent que lentement à la surface. Elles se rassemblent partiellement à la surface supérieure du moulage ou à la face intérieure des moulages centrifugés.', '- Emploi de matières premières de bonne qualité contenant peu d\'oxygène et de soufre ou désulfuration poussée.\n- Emploi d\'une poche théière.\n- Réglage corrélatif, au plus bas, de l\'addition de magnésium. Éventuellement prolongation du temps de maintien au repos après traitement au magnésium.\n- Régler la teneur en carbone en fonction de la température de coulée.', 19),
	(44, 'D113', 'Rides', 'None', 'Plis serpentant sans solution de continuité. Les bords du pli sont au même niveau. La surface de moulage est lisse.', 'Sillons en forme de plis dans la surface du moulage se propageant en serpentant, sans solution de continuité profonde. La surface du moulage peut être lisse et brillante.\n\nContrairement au défaut D 132 (queue de rat) les deux bords de ces sillons sont au même niveau.\n\nSe rencontre sur les surfaces horizontales ou bombées des pièces minces.\n\nAvec la fonte à graphite lamellaire hypereutectique il peut apparaître simultanément de l\'écume de graphite surtout dans les régions épaisses. Les rides peuvent être un point de départ pour des reprises (C 311).', '- Par suite de la solidification superficielle d\'un métal trop visqueux ou trop froid les plissements formés par les peaux d\'oxyde, au voisinage de la surface ne sont pas aplanis par la pression du métal liquide.\n- Lors de l\'emploi d\'argiles (bentonites) de faible réfractairité comme agglomérants pour la coulée d\'acier (ou plus rarement de fonte) la surface du sable peut subir un ramollissement et une déformation sous la poussée du métal liquide.\n\nLa dilatation du sable n\'est pas en cause dans ce cas qu\'il ne faut pas confondre avec le défaut D 132 (queue de rat) caractérisé par des bords dissymétriques.', '- Employer des matières premières à faible teneur en oxygène et en soufre.\n- Élever la température de coulée, éventuellement réduire le temps remplissage en augmentant la section d\'attaque. de\n- Éviter la coulée dans des coquilles trop froides.\n- Pour l\'acier moulé, choisir un liant plus réfractaire.\n- Voir aussi défaut D 132.', 19),
	(45, 'D114', 'Fleurs Traces d\'écoulement', 'None', 'Lignes marquant, sur la surface du moulage, l\'écoulement du métal liquide (alliage légers).', 'Sur la surface qui par ailleurs est saine, il apparaît des lignes, marquant éventuellement le parcours des filets de métal liquide.', 'Peaux d\'oxyde, marquant en partie le parcours des filets de métal liquide.\n\nNota: Ce défaut peut conduire à des reprises (C 311).', '- Élever la température du moule.\n- Abaisser s\'il y a lieu la température de coulée.\n- Modifier la disposition et la taille des attaques (en coulée par gravité ou sous basse pression).\n- Incliner le moule pendant la coulée.\n- En coulée sous pression soumettre les surfaces du moule perpendicu laires ou à peu près perpendiculaires au plan de joint à un dépolissage par projection de liquide ou de sable.', 19),
	(46, 'D121', 'Rugosité', 'None', 'Rugosités dont la profondeur est de l\'ordre de frandeur des dimensions des grains de sable.', 'La surface de la pièce est rugueuse. La profondeur des rugosités est de l\'ordre de grandeur des dimensions des grains de sable avec éventuellement des inclusions de sable.\n\nDans le cas du moulage à vert, la rugosité apparaît souvent en même temps que d\'autres défauts provenant de la dilatation du sable D 132 (queue de rat), D 230 (gale), ce qui la distingue des défauts D 122 (pénétration), D 221 (grippure) et D 222 (vitrification).\n\nSe produit surtout en moulage à vert aux endroits qui correspondent au «plafond» de l\'empreinte, en moulage étuvé aux endroits qui n\'ont pas ou pas suffisamment été passés à la couche ou au noir.', 'A la surface de séparation métal-sable, il y a un équilibre entre les forces capillaires du sable (perméabilité aux gaz), la tension superficielle du métal et la pression métallostatique. Si la pression métallostatique dépasse les forces qui lui sont opposées, le métal liquide pénètre entre les grains de sable de la paroi du moule, ce qui provoque la rugosité de la surface du moulage, et peut même après dépassement d\'une valeur critique (pression de pénétration) conduire au défaut D 122 (pénétration).\n\nEn outre par suite de la dilatation de la silice, des grains de sable peuvent être désagrégés, donnant ce qu\'on appelle une «pluie de sable». Après remplissage de l\'empreinte les endroits où s\'est produit cette pluie de sable présentent le défaut D 121 (rugosité).', '- Emploi de sable à granulométrie plus fine. \n- Addition d\'une quantité de sable fin au sable de moulage.\n- S\'agissant de fonte, addition de noir minéral, ou de granulés de brai au sable de moulage.\n- Diminution de la contrainte de compression du sable (voir défauts D 230).\n- Passage d\'une couche ou augmentation de son épaisseur. \n- Serrage plus fort et plus régulier.\n- Abaissement de la température de coulée.\n- Diminution de la pression métallostatique.', 20),
	(47, 'D122', 'Forte rugosité Pénétration Coup de feu', 'None', 'Rugosités dont la profondeur est supérieure aux dimensions des grains de sable.', 'Surface très rugueuse. La rugosité est d\'un ordre de grandeur supérieur à celui de la dimension des grains de sable. A l\'ébarbage, ce défaut ne peut être éliminé que très difficilement.', '- Comme pour le défaut D 121 (rugosité) mais plus accentuées.\n- Une réaction chimique métal-moule peut, par la formation d\'un laitier visqueux à basse température, renforcer la pénétration.\n- Excès de pression pouvant être créé ou renforcé par des explosions à la coulée (coup de feu).', 'Les mesures recommandées pour éviter le défaut D 121 (rugosité) doivent être non seulement prises, mais renforcées.\n\n- Éviter les réactions moule-métal.\n- Adopter des attaques qui évitent les coups de feu.\n- Éviter la formation de couches de condensation. \n- Employer un sable de plus grande finesse.\n- Régler convenablement la proportion de poussier dans le sable. N\'employer que du poussier de houille ou de brai de qualité appropriée.\n- Diminuer le taux d\'humidité du sable.\n- Serrer plus fort et surtout plus régulièrement.\n- Dans le cas de moulage à haute pression, contrairement au cas du moulage normal, une augmentation de l\'addition de bentonite agit dans un sens favorable.', 20),
	(48, 'D131', 'Stries', 'None', 'Sillons de diverses longueurs, souvent ramifiés, avec fond d\'entaille et bords adoucis.', 'Sillons à bords adoucis dans la surface du moulage, le plus souvent ramifiés. Profondeur de l\'ordre de 2 mm. \n\nSe produit sur toutes les surfaces mais en général sur les surfaces horizontales supérieures et inférieures.', 'Ce défaut est un début de gale, la dilatation de la silice produit un commencement de soulèvement qui ne s\'est pas poursuivi jusqu\'à l\'éclatement de la croûte de sable avec pénétration du métal dans la partie sous-jacente (gale).\n\nLes causes et les remèdes se confondent avec ceux de la gale (voir D 231, article et exemples).\n', '.', 21),
	(49, 'D132', 'Queue de rat', 'None', 'Sillons pouvant atteindre 5mm de profondeur, l\'un des deux bords formant un pli qui recouvre plus ou moins complètement le sillon.', 'Défaut superficiel n\'apparaissant en général que sur les faces du moulage en contact avec la paroi horizontale inférieure de l\'empreinte. Il consiste en un sillon pouvant avoir jusqu\'à 5 mm de profondeur, avec un bord à angle vif qui emprisonne souvent des grains de sable.\n\nLes queues de rat partent le plus souvent des attaques de coulée et sont assez rarement reliées les unes aux autres par des ramifications (figure 145a). Dans les cas où le sable a une forte tendance à l\'apparition de ce genre de défaut les queues de rat peuvent être accompagnées de stries (D 131) et de gales (D 230).\n\nDes «<rides» (défaut D 113) peuvent s\'étendre parallèlement à de légères << queues de rat» ou les recouvrir. Leur différence de niveau avec la surface saine avoisinante est à peine perceptible (figure 145b).', 'Comme pour les gales (D 230).\n\nFormation sous l\'effet de la chaleur d\'une zone de condensation et décollement de la croûte du sable par dilatation de la silice. La croûte ainsi formée dépasse les dimensions de son ancien emplacement.\n\nLorsque cette écaille ne s\'aplatit pas elle forme des queues de rat à la surface.\n\nNota: Ce n\'est pas toujours la longueur, mais plutôt la profondeur des queues de rat qui caractérise la tendance d\'un sable à produire ce défaut.', 'Voir défaut D 230. Il est surtout important d\'ajouter du noir au sable.', 21),
	(50, 'D133', 'Cicatrices', 'None', 'Dépressions irréglièrement réparties de dimensions variées courant à la surface du moulafe, le plus souvent en suivant le chemin d\'écoulement du métal liquide(acier moulé).', 'Dépressions irrégulièrement réparties allongées ou en forme de calotte, suivant en règle générale le chemin que parcourt le métal liquide et se situant dans les angles morts et dans les régions éloignées des attaques. Apparaissant souvent en même temps que des porosités superficielles. Avant l\'ébarbage il y a de la calamine dans les cicatrices.', '- Teneur en gaz trop élevée dans le métal liquide par suite d\'une désoxydation insuffisante.\n- Couches produisant beaucoup de gaz.', '- Désoxyder soigneusement l\'acier liquide.\n- Raccourcir le trajet du métal liquide dans le moule.\n- Augmenter le nombre des attaques, incliner le moule.\n- S\'agissant de moules importants diminuer fortement la durée de la coulée. \n- Étuver suffisamment le moule et employer des couches pauvres en gaz.\n- Prévoir une évacuation d\'air largement suffisante à travers le moule et les noyaux.', 21),
	(51, 'D134', 'Peau d\'orange', 'None', 'Surface grêlée comme marquée de petite vérole sur toute la pièce.', 'Toute la surface de la pièce est recouverte de pustules, en creux, présentant un aspect de petite vérole. Les dimensions des pustules sont variables selon l\'importance du défaut. Elles sont plus importantes sur les pièces ou parties de pièces les plus épaisses.', 'Emploi d\'un sable synthétique insuffisamment régénéré et pollué par des déchets acides provenant des noyaux et des additifs (huiles, dextrines, résines furanniques, acide phosphorique, mogul, poussières d\'oxyde ferrique, cendres de farine de bois, etc.).\n\nRéaction à haute température entre ce sable et le métal liquide.', '- En dépannage : ajouter au sable du carbonate de soude en solution dans l\'eau de malaxage.\n- Solution définitive : utiliser un sable synthétique calcique correctement régénéré ou sodique.\n\nLa mesure du pH est un moyen de surveillance de la dégradation du sable.', 21),
	(52, 'D135', 'Etamage Erosion', 'None', 'Sillons et rugosités au voisinage des angles rentrants de la pièce en coulée sous pression.', 'Sillons et rugosités sur de petites sections de la surface, en général dans les angles rentrants des pièces coulées sous pression.\n', 'Action du métal liquide sur le moule. S\'il s\'agit d\'alliage d\'aluminium, il peut former un alliage avec le métal du moule surtout dans les endroits où le courant de métal liquide est rapide. Cet alliage constitue une couche qui peut être arrachée lors de l\'extraction du moulage.\n', '- Éviter l\'effet d\'érosion du courant de métal liquide en améliorant le dispositif d\'attaque.\n- Soigner le poteyage.\n- Ajuster la température de coulée.\n- Augmenter les dépouilles prévues pour l\'extraction.\n- Nettoyer plus souvent le moule.', 21),
	(53, 'D141', 'Poquette', 'None', 'Dépression à la surface du moulgae dans un région d\'accumulation de chaleur.', 'Affaissement de surface du moulage dans les régions d\'accumulation de matière. La surface de cet affaissement ne se distingue en général pas du reste de la surface du moulage.\n\nCe défaut apparaît le plus souvent aux épaississements de section et souvent à l\'aplomb d\'une retassure interne ou d\'une porosité.', 'Contraction à la solidification aux noeuds qui constituent une accumulation de matière. \n\nEn coulée sous pression, éventuellement en corrélation avec une température trop basse du métal et/ou du moule et une pression insuffisante.\n\nNota: En cas d\'insuffisance locale d\'évacuation de gaz, il peut aussi se produire à cet endroit des défauts B 121 (refus). Il n\'est pas toujours facile de caractériser le défaut et les deux causes doivent être prises en considération (voir aussi défaut B 311 porosités).', '- Modifier le tracé, supprimer les changements brusques de section. \n- Agrandir les sections de liaison avec les accumulations de matière. \n- Si possible, ajouter des masselottes ou des attaques supplémentaires. \n- En coulée sous pression, vérifier la température du métal et du moule ainsi que la vitesse et la pression de la coulée.', 22),
	(54, 'D142', 'Inclusion de scorie', 'None', 'Petite cavités superficielle en forme de gouttes oud e cuvettes en général colorées en g-vert \n(aciers au chrome carburés, coulés en fonderie de précision à modèle perdu).', 'Petites cavités superficielles ayant la forme de gouttes ou de cuvettes en général colorées en gris-vert.', 'Il se produit vraisemblablement par réaction entre le moule et le métal des crasses facilement fusibles qui adhèrent au moulage mais qui sont arrachées lors du sablage et laissent une cavité en forme de goutte. Ce phénomène s\'observe avant tout avec les aciers alliés à forte teneur en chrome. Il est favorisé par un refroidissement relativement lent.', '#NOM?', 22),
	(55, 'D211', 'Enfoncement (de moule)', 'None', 'Approfondissement souvent étendu  sans contrepartie.', 'Dépression ou cavité souvent de grande étendue qui a le même aspect de peau que la pièce. Ce défaut correspond à une déformation ou à un déplacement d\'une partie de la surface de la pièce. Il n\'y a pas saillante. de contrepartie', 'Une partie du moule a été enfoncée en bloc. Une région de l\'empreinte a donc été déplacée vers l\'intérieur du moule en diminuant d\'autant l\'épaisseur de la pièce. Cette déformation du moule peut être due:\n- à un remmoulage sur une couche de sable irrégulière et dure;\n- à un chargement ou un crampage exagéré;\n- à un manque de planéité du support du moule;\n- au déplacement d\'un crochet ou d\'une armature.', 'Non renseigné', 23),
	(56, 'D221', 'Sable brûlé, grippure', 'None', 'Sable adhérent fortement à la pièce et formant surépaisseur.', 'Croûte de sable adhérant fortement à la pièce qui ne peut être éliminée par un grenaillage de durée normale mais exige un meulage. Ce défaut est localisé dans les parties les plus chaudes du moulage.\n', '- Réaction chimique moule-métal (formation de fayalite). \n- Réfractairité insuffisante du sable.\n- Serrage insuffisant.\n- Mouillabilité du sable.\n- Température de coulée exagérée.', '- Améliorer le dépoussiérage et le taux de régénération du sable. \n- Augmenter, s\'il y a lieu, le taux des additifs contenant des hydro-carbures.\n- Utiliser un enduit ou renforcer son épaisseur.\n- Serrer plus énergiquement.\n- Contrôler la température de coulée.', 24),
	(57, 'D222', 'Vitrification', 'None', 'Sable très adhérent et en partie fondu.', 'Croûte mince de sable fondu, solidement adhérente au moulage. La surface a un aspect vitreux, éventuellement pustuleux. \n\nSe produit de préférence sur les surfaces ayant été portées aux températures les plus élevées. ', '#NOM?', '- Sable plus réfractaire.\n- Dispositif de coulée évitant les accumulations de chaleur.\n- Température de coulée plus basse.\n- Voir D 221.', 24),
	(58, 'D223', 'Abreuvage', 'None', 'Conglomérat de sable et de métal hérant fortement au moulage dans les régions les plus chaudes (angles rentrants et noyaux).', 'Excroissance de forme non géométrique, constituée par un mélange intime de sable et de métal, d\'aspect spongieux, fortement adhérent à la pièce généralement localisé dans les parties de sable les plus chaudes (noyaux, parties concaves) et les moins denses.\n\nParticularité : Le défaut D 223 ne se rencontre pas sur les moulages en alliages de magnésium ou d\'aluminium.', 'Les facteurs ci-dessous tendent à favoriser l\'abreuvage :\n- Faible tension superficielle du métal liquide : . \n\n- teneur élevée en phosphore, en silicium, en manganèse, pour les alliages ferreux, \n- teneur élevée en phosphore ou en plomb pour les alliages cuivreux.\n\n- Pressions statique et dynamique élevées.\n- Température du métal et du sable élevée.\n- Sable trop gros ou insuffisamment serré.\n- Réfractairité du sable insuffisante (quantité trop élevée d\'argile ou d\'éléments fondants).\n- Sable trop chargé en agglomérant.\n- Conductibilité thermique du sable trop faible. Qualité insuffisante de l\'enduit ou du noir minéral.\n- Dans le cas de l\'acier, réaction physico-chimique d\'inclusions ou d\'oxydes basiques sur le sable généralement acide.', 'Agir sur les facteurs énumérés ci-dessus (voir également D 122 et D 222).', 24),
	(59, 'D224', 'Décollement de la première couche Gale', 'None', 'Ecaille de moule emprisonnée dans le métal (fonderie de précision à modèle perdu).', 'Écaille de moule emprisonnée dans le métal.\n', '#NOM?', 'Réajustement des cycles de trempe et de séchage.', 24),
	(60, 'D231', 'Gale franche', 'None', 'Excroissance métallique en forme de lame à parois rugueuses parallèles à la surface, susceptible d\'être éliminée par burinage.', 'Excroissance métallique irrégulière d\'une épaisseur de quelques millimètres, en général à bords aigus, parallèle à la surface du moulage, à sur face très rugueuse, qui d\'habitude ne tient au moulage que par endroits. Pour le reste elle s\'en éloigne. La surface du moulage sous ce défaut présente une dépression qui épouse la forme et la grandeur de la gale. Les gales franches peuvent être détachées au burin, mais l\'attache à la pièce reste apparente et la dépression subsiste.\n\nLa gale franche (D 231) se produit sur tous les moulages principalement sur : \n- la surface horizontale supérieure de l\'empreinte (gale de plafond), \n- la surface inférieure horizontale de l\'empreinte (gale de plancher).\n\nElles se forment moins souvent sur les parois latérales.', '1/ Gale de plafond:\n    \n1.1. - Apparition d\'une zone de condensation de faible résistance puis formation d\'une croûte dont la dilatation est contrariée par la contrainte de compression dans la paroi de l\'empreinte. Compression de cette croûte contre le sable de remplissage par l\'arrivée du métal liquide et éclatement de la croûte. Le métal liquide vient s\'infiltrer dans l\'espace qui peut rester entr la croûte et le reste du moule et forme une languette qui consti tue la gale. Si cette pénétration ne se produit pas, c\'est le défaut D 131 (stries).\n\n1.2. - Apparition d\'une zone de condensation de faible résistanc - Formation d\'une croûte non contrariée par la contrainte de compression. La croûte ne se rompt pas et pénètre dans l\'empreinte où elle se dilate (sillon). Le métal remplit la cavité qui s\'est formée derrière la croûte en donnant des excroissances plates partant de l\'angle : défaut A 114 (gale d\'angle).\n\n2/ Gale de plancher : \n    \nLa nappe de métal entrant dans l\'empreinte provoque rapidement une zone de condensation d\'humidité de faible résistance. Ensuite une avec d\'assez fortes contraintes de compression dans la paroi de l\'empreinte il se produit une croûte dont la formation est contrariée le long de cette zone. \n\n2.1.- La croûte ne se sépare pas complètement du sable de remplissage et glisse par suite de la dilatation de la silice sur la région avoisinante de la paroi de l\'empreinte. Les bords de cette croûte s\'élèvent ce qui produit des queues de rat (R) ou bien, s\'ils s\'élèvent au point que du métal peut pénétrer sous la croûte, des gales (S).\n\n2.2. - La croûte se soulève entre deux flux de métal liquide puis est comprimée par la continuation de l\'arrivée de métal liquide. Si elle ne se rompt pas il se produit seulement un enfoncement de la surface du moulage (défaut D 211). Si elle se rompt et si le métal liquide pénètre dans la cavité qu\'elle a laissée, il y a formation d\'une gale.', '1/Augmentation de la résistance à vert par :\n- plus forte proportion d\'agglomérant (argile, bentonite);\n- emploi d\'une meilleure qualité d\'argile (bentonite);\n- activation de la bentonite par la soude;\n- bon refroidissement du sable en circuit; meilleure préparation du sable (malaxage);\n- choix d\'un sable plus gros.\n\n2/ Diminution des contraintes de compression : \n    \n- remplissage de l\'empreinte plus rapide et plus régulier;\n- éviter une trop forte humidité du sable; \n- emploi d\'additifs qui par ramollissement ou combustion compensent la dilatation de la silice: poussier de charbon, brai, bitume. N\'utiliser néanmoins qu\'avec précaution les additifs qui ont une forte action ramollissante tels que la farine de tourbe et la farine de bois car leur emploi entraîne une diminution de la résistance à vert du sable; \n- remplacement total ou partiel du sable siliceux par des sables réfrac taires à faible dilatation et ne comportant pas, comme la silice, des transformations allotropiques accompagnées au chauffage de fortes expansions. Le sable de zircon remplit ces conditions.\n\n3/Tirer l\'air. Augmenter la perméabilité.\n\n4/ Remèdes généralement à déconseiller : Pointer; incliner le moule; couvrir les parties menacées avec des tôles.', 25),
	(61, 'D232', 'Gale volante', 'None', 'Comme ci-dessus, mais l\'élimination n\'est possible que par usinage ou meulage.', 'Surépaisseurs massives irrégulières, de faible ou de forte surface en général de plusieurs mm d\'épaisseur à bords irrégulièrement formés ayant un aspect de cassure, avec formation de croûtes multiples, se superposant les unes sur les autres, plus ou moins parallèles à la surface du moulage avec une surface rugueuse. Les surépaisseurs paraissent souvent crevassées par suite d\'inclusions de croûtes de sable. Les moulages présentant ce défaut comportent des inclusions de croûtes de sable en général près de la surface supérieure du moulage. Ces surépaisseurs ne peuvent être éliminées que par usinage ou par meulage, en admettant que les inclusions de sable correspondantes puissent être tolérées.\n\nSe produit surtout sur les faces qui correspondent au plancher et au plafond de l\'empreinte.', 'Le mécanisme de la formation des gales volantes est le suivant : \n\n1/ Au plafond de l\'empreinte ou le long de parois verticales ou inclinées de l\'empreinte :\n\n1.1.- Formation d\'une zone de condensation d\'humidité de faible résistance. Rupture en plusieurs morceaux de cette croûte séchée lorsque sa dilatation est contrariée. Lors du remplissage de l\'empreinte ces morceaux de croûte surnagent et vont jusqu\'au plafond de l\'empreinte. Outre les gales crevassées on trouve aussi des gerces (A 112) ou des queues de rat (D 132).\nVoir aussi défaut A 112 (gerces)\n\n2/ Au plancher de l\'empreinte.\n\nLe métal liquide provoque rapidement une zone de condensation de faible résistance; par suite des fortes contraintes de compression et de la faible résistance à vert du sable, la croûte se sépare du sable sous jacent et, surtout si le sable a une forte mouillabilité, elle est entraînée par le métal liquide et monte en flottant jusqu\'au plafond. Le métal liquide vient remplir la cavité qui s\'est formée dans le plancher, d\'où une gale volante (S). En outre la croûte vient former des inclusions (E) près du plafond de l\'empreinte et il y a souvent des porosites dans la région supérieure de l\'empreinte.', 'Les mêmes que pour D 231 (gale franche).', 25),
	(62, 'D233', 'Dartres', 'None', 'Excroissances métalliques plates sur des moulages obtenus en moules étuvés passés à la couche ou au noir ou en moules à vert avec des noyaux passés à la couche ou au noir.', 'Surépaisseur à la surface du moulage, sous forme aplatie, à surface rugueuse d\'un côté et à bords en général aigus. Si elle ne tient au moulage que par une petite surface on peut en général l\'éliminer au burin (dartre de noir ou de couche). Sous la dartre la surface du moulage présente une légère dépression. Si la surépaisseur fait corps avec le moulage (dartre déplacée par le courant de métal) on trouve plus ou moins loin une ou des inclusions de sable. Cette surépaisseur ne peut être éliminée que par le meulage à condition que les inclusions correspondantes puissent, par ailleurs, être tolérées.\n', 'La couche, souvent riche en argile, subit une contraction à chaud alors que le sable siliceux sous jacent se dilate. Si l\'adhérence de la couche est insuffisante, ces deux mouvements contraires peuvent provoquer son décollement avec maintien sur place de la pellicule (dartre franche) ou déplacement de celle-ci par le mouvement du métal ou par la gravité (dartre volante).\n', '- Couche présentant une faible contraction à chaud.\n- Couche d\'épaisseur modérée et régulière.\n- Couche à pouvoir mouillant élevé, pénétrant dans le sable. Sable présentant une moindre dilatation à chaud (voir D 231 et D 232).\n- Séchage correct.', 25),
	(63, 'D241', 'Calamine', 'None', 'Adhérence d\'oxyde après recuit.', 'Couche d\'oxyde adhérente qui en général ne s\'effrite que sous l\'effet de chocs ou de flexions répétés. Dans certains cas cette couche est si adhérente qu\'elle ne se révèle qu\'après rupture de la pièce. La coloration due à ce défaut n\'est pas reconnaissable après grenaillage.\n', '- Atmosphère oxydante lors du recuit.\n- Le four n\'est pas étanche.', '- Contrôler l\'atmosphère du four et son étanchéité.com\n- Éviter le chargement de pièces ou de matériel humide D 243).', 26),
	(64, 'D242', 'Collage de minerai', 'None', 'Adhérence de minerai après recuit de malléable à coeur blanc.', 'Présence de minerai en moulages en partie fondu fortement adhérent à la surface des malléable à coeur blanc, traités au minerai.', '#NOM?', '- Contrôler soigneusement la température lors du recuit. \n- Employer du minerai présentant une température de ramollissement élevée.\n- Éviter l\'emploi de minerai comportant une forte proportion de fines.\n- La grosseur optimale des grains va de 5 à 15 mm.', 26),
	(65, 'D243', 'Ecaillage', 'None', 'Ecaillage après recuit de malléable à coeur blanc.', 'Séparation de couches parallèles à la surface à la suite du recuit en atmosphère oxydante.\n', 'Sulfuration de la région superficielle du moulage par une atmosphère contenant de l\'anhydride sulfureux ou de l\'hydrogène sulfuré. L\'anhydride sulfureux peut aussi provenir de l\'oxydation des sulfures contenus dans la fonte au début du traitement de malléabilisation. La phase riche en sulfure de fer qui peut en résulter est liquide aux températures habituelles de malléabilisation. Avec la progression de la décarburation elle peut pénétrer dans le moulage principalement par les joints de grains et former en fonction de la teneur en silicium un réseau plus ou moins serré de sulfures.\n\nDans la région extérieure au réseau de sulfure, zone fortement décarbu rée, il se forme des oxydes contenant du manganèse et du silicium dont la formation est accompagnée d\'une augmentation de volume. La structure devient lâche, jusqu\'à la formation de cavités.\n\nLa couche extérieure jusqu\'à la zone de cavités peut éclater au refroidissement du moulage. Une deuxième écaille, dans la région du réseau de sulfure se forme, seulement quand la pièce subit une déformation. La résistance du réseau de sulfures est très faible (couche intermédiaire fine non métallique très fragile).\n\nIl est possible également que, par suite d\'une atmosphère de recuit très oxydante dans le domaine de la formation de FeO des inclusions de sulfures soient immédiatement oxydées d\'où libération de SO? qui provoque un nouveau réseau de sulfures. Le silicium et le manganèse de la couche extérieure sont aussi scorifiés à l\'état de silicate de manganèse.\n\nCes conditions conduisent à une large zone superficielle à structure lâche, plutôt qu\'à un alignement de trous', '- Diminuer la teneur en silicium de l\'alliage.\n- Diminuer la teneur en soufre de l\'alliage ou augmenter la teneur en manganèse. \n- Veiller à ce que le minerai soit pauvre en soufre, éventuellement diminuer la proportion de minerai neuf. \n- Diminuer la teneur en soufre de l\'atmosphère du four.\n- Contrôler l\'étanchéité des pots.', 26),
	(66, 'E111', 'Malvenu', 'None', 'La pièce est, dans l\'ensemble, complète à l\'exception d\'arêtes plus ou moins arrondies.', 'La pièce est complète à l\'exception des angles saillants qui sont plus ou moins arrondis. S\'agissant de fonte, la surface est généralement brillante et se laisse bien décaper.', '- Manque de fluidité et de coulabilité du métal liquide dû à une température de coulée trop basse eu égard à la composition. \n- Remplissage trop lent de l\'empreinte par suite d\'une trop faible section des jets et des attaques.\n- Dégagements d\'air insuffisant (perméabilité, évents, tirages d\'air). - En coulée en coquille : température trop basse de la coquille.', '- Régler la température de coulée assez haut, eu égard à la composition chimique de l\'alliage et aux épaisseurs du moulage.\n- Vérifier le système d\'attaque et augmenter les sections s\'il y a lieu. \n- En coulée en coquille : élever la température de la coquille.\n- Améliorer la perméabilité et les dispositifs de dégagement des gaz.', 27),
	(67, 'E112', 'Défauts de réparation ou de passage à la couche', 'None', 'Arêtes ou contours déformés par la suite de mauvaises retouches du moule ou de passage à la couche défectueux.', 'En certains endroits, les angles saillants ou rentrants sont irrégulièrement arrondis, ou manquent complètement alors que les formes avoisinantes correspondent bien à celles du modèle.\n', 'Réparations mal exécutées, enduit irrégulièrement appliqué sur les moules et noyaux, formant des protubérances dans l\'empreinte et laissant des traces dans le moulage, souvent sous forme de gouttes.\n', 'Soins dans les réparations des moules et dans le passage de la couche.\n', 27),
	(68, 'E121', 'Manque', 'None', 'Pièce incomplète par suite de solidification prématurée.', 'Une partie de la pièce manque, généralement à la partie supérieure du moule ou dans une région éloignée des coulées. Les arêtes à l\'endroit du défaut sont arrondies. Les surfaces avoisinant le défaut en général sont brillantes. Les jets de coulée, chenaux, attaques sont bien remplis (différence avec le défaut E 122).', '- Température de coulée trop basse. Fluidité et coulabilité du métal insuffisantes.\n- Système d\'attaque de section insuffisante ou mal conçu eu égard à la forme du moulage.\n- En moulage en coquille : température trop basse de la coquille, départs d\'air insuffisants.\n\nNota: Ne pas confondre avec les défauts E 122 et E 123.', '- Élever la température de coulée.\n- Modifier la conception ou les dimensions du système de coulée.\n- Prévoir des tirages d\'air plus efficaces. \n- Élever la température de la coquille.\n- Si les conditions le permettent, s\'entendre avec le client pour augmenter les épaisseurs de la pièce.', 28),
	(69, 'E122', 'Coulé court', 'None', 'Pièce incomplète par insuffisance de métal.', 'La partie supérieure du moulage manque. voisinage de la partie manquante sont légèrement arrondies, tous les autres contours sont conformes au modèle. Le jet de coulée, Les arêtes au les masselottes et évents situés latéralement ne sont remplis que jusqu\'au niveau limite de remplissage de la pièce (principe des vases communiquants) (contrairement à ce qui se passe pour le défaut E 121).', '- Quantité insuffisante de métal liquide dans la poche.\n- Interruption prématurée de la coulée par suite d\'une erreur de l\'ouvrier qui croit que le moule est rempli du fait d\'une section d\'attaque insuffisante par rapport à celle du jet et du chenal.\n\nNota: Ne pas confondre avec les défauts E 121 et E 123.', '- Préparer une quantité suffisante de métal.\n- Vérifier le système d\'attaque.\n- Instructions au couleur et surveillance.', 28),
	(70, 'E123', 'Moule vidé', 'None', 'Pièce incomplète par suite de fuite de métal hors du moule.', 'Une partie de la pièce manque. La surface supérieure est en général concave et se prolonge souvent en bavure tapissant plus ou moins les parois du moule.\n\nLa partie manquante peut d\'autre part, surtout pour des moulages épais, être localisée à l\'intérieur de la pièce qui semble s\'être vidée. Ne pas confondre avec E 121 (manque) ou E 122 (coulé court).', '- Étanchéité insuffisante du moule ou résistance insuffisante des parois du moule et des noyaux (surtout pour les moulages épais) ces parois venant à se rompre sous l\'effet d\'une forte pression métallostatique.\n- Des ouvertures de montage du moule ou du noyau n\'ont pas été fermées par suite d\'une négligence.\n- Les évents pour départ d\'air des noyaux ont été mal tamponnés. \n- Les surfaces des plaques modèles de la partie de dessus et de la partie de dessous ne se correspondent pas. Dans le moulage à main raccord de joint mal fait; dans le moulage à la machine plaque-modèle mal-propre.\n- Le moule a été mal crampé ou insuffisamment chargé (voir aussi défaut A 121).\n- Le décochage a été effectué prématurément.\n\nNota: Dans le cas d\'un moule mal crampé ou insuffisamment chargé, ce défaut se produit en même temps que le défaut A 121 (soulèvement de moule).', 'Remédier aux causes possibles indiquées ci-dessus.', 28),
	(71, 'E124', 'Grenaillage excessif', 'None', 'Manque de matière important par suite d\'un grenaillage exagéré.', 'Manque de matière sur les surfaces plates de certaines pièces d\'arêtes observés seulement après grenaillage, dans n\'importe quelle région du moulage. ou manque\n', '- Fort enlèvement de métal par suite d\'un grenaillage trop intense dû à un défaut du matériel ou à une négligence du personnel.', 'Limiter le grenaillage dans l\'ensemble ou localement. Veiller au bon fonctionnement du matériel.', 28),
	(72, 'E125', 'Fusion ou effondrement au recuit', 'None', 'Moulage partiellement fondu ou profondément déformé au cours du recuit.', 'Après le recuit, il manque une partie en général saillante, de la pièce qui semble avoir été partiellement fondue ou bien toute la pièce s\'est effondrée et a perdu ses contours. On trouve le métal manquant sous forme de gouttes ou de masse informe contre le moulage ou à proximité de celui-ci', '#NOM?', '- Régler la température de recuit de façon à atteindre mais à ne pas dépasser celle qui est nécessaire pour obtenir la modification de struc ture désirée, compte tenu de la composition de l\'alliage.\n- Contrôler constamment la température effective de recuit.', 28),
	(73, 'E211', 'Cassure à froid', 'None', 'Pièce cassée, partie manquante importante. Cassure non oxydée.', 'Une partie du moulage manque. A l\'endroit du défaut la pièce présente un aspect de cassure(voir aussi défaut C 111).\n\nSe produit dans toutes les régions de la pièce, de préférence aux parties saillantes : nervures, bossages, angles saillants.', '- Décochage brutal.\n- Manutention défectueuse, choc.\n- Souvent aussi suite d\'une fêlure à froid (défaut C 111).', 'Soin dans le décochage et les manutentions.\n', 29),
	(74, 'E221', 'Jet, masselitte ou évent cassé dans la pièce Epaufrure', 'None', 'Cassure de dimension limitée au voisinage des attaques, évents, etc. Angle cassé ou maté.', 'Dans la région de l\'attache des jets, évents, masselottes sur la pièce, il y a une cassure de forme irrégulière dont la surface pénètre à l\'intérieur de la pièce. La surface de la cassure peut être oxydée.', '- Les attaques, évents et masselottes ont été prévus trop grands, ou ne sont pas entaillés au col, ou le sont, mais insuffisamment. \n- L\'ébarbage a été effectué trop brutalement eu égard aux dimensions du moulage, ou maladroitement.', '- Dimensionner de façon correcte l\'attache ou le col des attaques, évents et masselottes, en tenant compte de l\'épaisseur du moulage. \n- Éventuellement, prévoir un étranglement, un noyau d\'étranglement.\n- Procéder correctement au décochage, à la manutention et à l\'ébarbage\n- Avant de casser les jets, évents et masselottes, exécuter une entaille à l\'aide d\'une meule tronçonneuse.', 30),
	(75, 'E231', 'Cassure à chaud', 'None', 'L\'aspect de la cassure montre qu\'elle a subi une oxydation à chaud.', 'Le moulage est cassé en plusieurs morceaux; la cassure est fortement oxydée dans le cas des alliages ferreux.', 'La pièce a été décochée trop tôt, les régions épaisses de la pièce, ou même toute la pièce, n\'étant pas encore complètement solidifiées ou se trouvant à l\'état pâteux.', 'Prolonger le refroidissement dans le moule.', 31),
	(76, 'F111', 'Erreur dans la prévision du retrait', 'None', 'Toutes les cotes sont fausses dans une même proportion.', 'Toutes les dimensions du moulage sont inexactes, mais dans une même proportion par rapport aux dimensions désirées.\n', 'Le retrait prévu lors de l\'exécution du modèle diffère du retrait réel de l\'alliage employé.\n', 'Établir ou modifier le modèle en se basant sur le retrait réel de la pièce,\nretrait établi par des mesures directes préalables.', 32),
	(77, 'F121', 'Retrait contrarié', 'None', 'Trop grandes distances entre parties fortement saillantes.', 'Les dimensions sont exagérées dans un sens où le moule, les noyaux ou les armatures offrent une résistance au retrait anormalement élevée.', '- Serrage exagéré du moule ou des noyaux. \n- Sable trop chargé en argile.\n- Noyaux contenant une proportion d\'agglomérant trop forte. \n- Armatures surabondantes ou mal disposées.\n\nDans les pièces minces, sable rugueux offrant à la pièce une possibilité d\'accrochage qui s\'oppose au retrait.\nUne pièce présentant ce défaut risque en outre d\'être le siège de tensions internes et d\'être sujette à crique ou à tapure (C 221-C 222).', '- Ne pas trop serrer le moule dans le cas du moulage à vert ou diminuer la proportion de liant ou d\'agglomérant dans les autres cas. \n- Améliorer la possibilité de désagrégation des moules ou noyaux étuvés ou durcis, par exemple à l\'aide d\'additifs appropriés.\n- Intercaler dans la masse du sable des produits susceptibles de s\'écraser sous l\'effet du retrait : coke, paille, polystyrène, ou simplement espace vide.\n- Contrôler la position des armatures, crochets ou autres renforcements. \n- Si les conditions le permettent, obtenir du client une modification du tracé.', 33),
	(78, 'F122', 'Retrait irrégulier', 'None', 'Certaines cotes sont inexactes.', 'Le taux de retrait est plus élevé dans les parties épaisses de la pièce.\n', 'Pour un même alliage, le retrait peut varier en fonction des structures qui peuvent elles-mêmes dépendre d\'un refroidissement plus ou moins rapide.\n\nD\'où la possibilité de taux de retrait variés entre des pièces d\'épaisseur différentes, entre les diverses parties d\'une même pièce thermiquement hétérogène, ou encore entre des pièces coulées dans des moules de conductibilités différentes.', '- Série :\nModifier le modèle en se basant sur le retrait réel des diverses parties de la pièce type coulée dans les conditions de la fabrication de série.\n\n- Pièce unitaire :\nExpérience préalable effectuée une fois pour toutes sur éprouvettes d\'épaisseurs diverses dans les conditions de moulage de coulée et avec l\'alliage envisagés.', 33),
	(79, 'F123', 'Excès d\'ébranlage', 'None', 'Les cotes sont trop grandes dans le sens de l\'ébranlage.', 'Les dimensions sont exagérées dans le sens de l\'ébranlage.\n', 'Non renseigné', '-Ébranler avec précaution.\n- Mettre une dépouille suffisante.\n- Disposer correctement les plaques d\'ébranlage.', 33),
	(80, 'F124', 'Dilatation du moule à l\'étuvage', 'None', 'Les cotes sont trop grandes dans le sens perpandiculaire au plan de joint.', 'Les dimensions de la pièce perpendiculairement au plan de joint sont trop fortes.\n', 'Sable trop gras ou trop humide qui, à l\'étuvage, gonfle et déborde du châssis.\n\nNota: Ne pas confondre avec le défaut A 121 (soulèvement de moule).', '#NOM?', 33),
	(81, 'F125', 'Serrage irrégulier Serrage insuffisant', 'None', 'Surépaisseurs irrégulières sur quelques faces externes. Identique à A211 (forçage).', 'Identique à A211', 'Identique à A211', 'Identique à A211', 33),
	(82, 'F126', 'Modèle ou plaque mmodèle déformé Voile', 'None', 'Parois d\'épaisseur inférieure à la cote, surtout s\'agissant de surfaces horizontales.', 'Épaisseurs insuffisantes dans les grandes surfaces, horizontales au moment du serrage.\n', 'La rigidité du modèle ou de la plaque modèle n\'est pas suffisante eu égard à la pression de serrage du sable. Il en résulte une déformation élastique du modèle avec une déformation permanente correspondante de l\'empreinte.\n\nEn vue du diagnostic, comparer les surfaces du modèle au repos avec les surfaces du moule.', 'Contrôler la rigidité des plaques modèles et modèles, notamment lorsqu\'on augmente les pressions de serrage.', 33),
	(83, 'F211', 'Modèle incorrect', 'None', 'Le moulage ne correspond pas au tracé soit dans son ensemble, soit dans certaines régions. Il en est de même du modèle.', 'Le moulage ne correspond pas au dessin, localement ou dans l\'ensemble. Le contrôle montre que le modèle ne correspondait pas au dessin.\n', '- Manque de précision du dessin.\n- Malfaçon lors de l\'exécution du modèle.\n- Manque de contrôle du modèle avant livraison.', 'Contrôler le dessin et le modèle au modelage.\n', 34),
	(84, 'F212', 'Erreur de montage du modèle', 'None', 'En un endroit bien déterminé le moulage ne correspond pas au tracé. Le modèle est correct.', 'Le moulage ne correspond pas au dessin dans une ou plusieurs régions. L\'enquête montre qu\'il y a eu confusion dans la mise en place des parties démontables.', 'Des parties démontables de modèle n\'ont pas été munies de repères ou ne l\'ont pas été de façon indiscutable.', '- Repérer les parties de modèle avec des traits de montage ou des couleurs ou des numéros.\n- Prévoir des modes d\'assemblage non susceptibles de confusion.\n- Montage du modèle avec le dessin en main.', 34),
	(85, 'F221', 'Variation de :\n - modèle \n - portée \n - plaque-modèle \n - moule \n - coquille \n Déformation de châssis Déplacement de moule', 'None', 'La pièce semble avoir subi un commencement de cisaillement dans le plan de joint.', 'La pièce semble avoir subi un commencement de cisaillement. Les saillies opposées sont égales et de sens contraire; de part et d\'autre du plan de cisaillement la forme de la pièce est correcte.', '- Mauvais repérage jeu dans les ou assemblages du modèle\n- Mauvais repérage ou jeu dans les portées\n- Mauvais repérage ou jeu dans une plaque-modèle\n- Jeu exagéré dans les châssis, non compensé par des artifices de repérage («soleil », repères, etc.). Mauvais repérage ou jeu dans une coquille \n- Précision des outillages correcte mais châssis faiblement dimen sionnés par rapport à la pression de serrage\n- Défaut non systématique sem blant se rattacher à un accident survenu au moule remmoulé\n- Mauvais repérage ou jeu dans les assemblages d\'une boîte à noyau.', 'Non renseigné', 35),
	(86, 'F222', 'Variation de noyau', 'None', 'Variation sur une face interne d\'une pièce dans le plan de joint du noyau.', 'Les deux parties des cavités du moulage formées par un noyau présentent dans le plan de joint du noyau (plan correspondant au plan de joint de la boîte) une translation relative; mais, prises séparément, elles correspondent bien au dessin en ce qui concerne la forme et les dimensions.', 'Non renseigné', ' Munir la boîte à noyau de repères corrects.\n- Limiter le jeu des assemblages de la boîte à noyau.\n- Ajuster exactement les éléments dans le cas de noyaux collés.', 35),
	(87, 'F223', 'Fausse variation', 'None', 'Saillie irrégulière généralement unilatérale sur des faces verticales, en général au voisinage du plan de joint.', 'Épaississement de la pièce au voisinage du joint (a) ou d\'une surface parallèle au joint (b). Ressemble au défaut F 221 (variation) dont il diffère par le fait que les déformations ne sont pas nécessairement égales et de sens contraire de part et d\'autre du joint. Le défaut peut encore être appelé du nom plus général de «fausse serre ».', 'Un mauvais serrage du moule a écarté le sable de certaines faces verticales du modèle.\n', 'Examiner en détail les conditions de serrage.\n', 35),
	(88, 'F231', 'Modèle déformé', 'None', 'Déformation par rapport au tracé sur le moulagen le moule et le modèle.', 'Le moulage présente des déformations localisées ou générales par rapport au dessin, mais pas par rapport au modèle qui est lui-même déformé de la même façon. Ces déformations sont systématiques.', 'Non renseigné', '- Vérifier la construction du modèle.\n- Utiliser un bois de qualité et d\'essence appropriées à cet usage. \n- Choisir une classe de modèle appropriée au genre de pièces et au mode de fabrication. -\n- Entreposer les modèles dans un local dont la température et l\'humidité sont constantes. \n- Gerber les modèles avec soin en utilisant des cales convenables.\n- Ne pas voiler le modèle ou la plaque modèle au moment du montage dans la machine à mouler ou sur le chantier. \n- Éviter que le modèle prenne l\'humidité du moule grâce à un vernissage correct avec un vernis adéquat et en limitant le temps de séjour du modèle dans le moule.', 36),
	(89, 'F232', 'Moule déformé', 'None', 'Déformation par rapport au tracé sur le moulage et le moule. Le modèle est conforme au tracé.', 'Le moulage présente par rapport au dessin et au modèle des déformations générales ou locales non systématiques.\n', '- Le modèle ou la plaque-modèle est l\'objet d\'une contrainte locale exagérée lors du serrage et subit une déformation élastique. \n- Le modèle ou la plaque-modèle est placé sur un support ou un chantier gauche ou insuffisamment rigide.\n- Le moule a été déformé avant coulée par suite d\'une déformation du châssis (par exemple au cours du transport). \n- Pose du moule sur une surface non plane.\n- Déformation pendant le transport, rigidité insuffisante du châssis. \n- Chargement exagéré ou irrégulier du moule.\n- Crampage défectueux.\n- Serrage insuffisant dans l\'ensemble ou en certains endroits.', '- Placer le modèle sur un sol bien plan. Dans le cas d\'une surface de joint non plane préparer une fausse partie précise. S\'agissant de plaques modeles montées sur un support, veiller à ce que ce support soit plan, que ele serrage soit bien régulier.\n- Couler des pièces d\'essai et les vérifier.\n- Renforcer les modèles légers par des « barres à boucher»\n- Exécuter les portées de noyau de telle façon qu\'ils contribuent à la rigidité. Monter les modèles sur plaque. Renforcer les plaques-modèles par des nervures.\n- Placer le moule sur un lit bien plan et également résistant. \n- Choisir des châssis suffisamment rigides.\n- Les poids de charge doivent être supportés par les parois latérales des châssis et intéresser des surfaces de joint suffisamment importantes.\n- Prévoir l\'importance de la cambrure par le calcul et par l\'expérience.\n- Serrer le moule autant qu\'il est nécessaire, éventuellement changer de matériau de moulage.\n- Disposer correctement les ancrages.', 36),
	(90, 'F233', 'Déformation au retrait', 'None', 'Déformation du moulage par rapport au tracé. Le moule et le modèle sont conformes au tracé.', 'La pièce présente dans l\'ensemble ou localement des déformations par rapport au dessin, au modèle et au moule, déformations qui peuvent se répéter plus ou moins régulièrement surtout dans les régions comportant des différences d\'épaisseur.', '- Retrait contrarié :\n    \n- par le tracé de la pièce,\n- par les masselottes et attaques, \n- par des parties de moule et noyaux.\n\n- Mauvaise technique d\'attaque et de coulée. \n- Retrait irrégulier causé par un décochage prématuré.', '- Modifier le tracé pour tenir compte des impératifs techniques.\n- Choisir la technique de coulée et d\'attaque de façon que la répartition de la température dans la pièce soit aussi régulière que possible. Déterminer le temps de coulée et la température de coulée corrects. Prévoir des dégorgeoirs.\n- Dégager les masselottes et attaques après la coulée.\n- Disposer des noyaux d\'écrasement.\n- Laisser le moulage se refroidir dans le moule.\n', 36),
	(91, 'F234', 'Déformation différée', 'None', 'Déformation du moulage par rapport au tracé.', 'Déformation de la pièce par rapport à sa forme initiale après stockage, recuit, usinage.\n', '- Après stockage prolongé ou usinage : il s\'agit de libération plus ou moins complète de contraintes résiduelles.\n- Après traitement thermique général ou localisé : il s\'agit soit de libération de contraintes, soit de l\'un des facteurs suivants :\n\n- température excessive ou hétérogène, \n- calage défectueux,\n- alliage de rigidité insuffisante à chaud, \n- conception de pièce rendant leur empilage et leur calage difficile,\n- trempe trop intense, \n- trempe dissymétrique,\n- évolution de l\'état structural de l\'alliage à la température ordinaire.', 'Concernant les contraintes, il convient en premier lieu de les éliminer ou de les réduire par un tracé convenable de la pièce et par un système d\'alimentation permettant un refroidissement aussi homogène et aussi lent que possible.\n\nConcernant les autres causes, les remèdes sont évidents.', 36),
	(92, 'G111', 'Inclusion métallique d\'origine extérieure, \ncombinaison intermétallique', 'None', 'Inclusions métallique dont l\'aspect, l\'analyse chimique ou l\'examen structural montrent qu\'il s\'agit d\'un élément étranger à l\'alliage.', 'Inclusions métalliques ou intermétalliques de diverses grandeurs qui différent nettement du matériau de base par la structure et la couleur, mais surtout par les propriétés. Ces défauts apparaissent le plus souvent lors de l\'usinage.', '- Combinaisons intermétalliques avec des métaux étrangers (impuretés étrangères).\n- En coulée par gravité ou sous pression d\'alliages d\'aluminium, surtout d\'alliage Al-Si (Cu) contenant du fer composés intermétalliques (Fe, Al, Mn, Si) sous forme de grains ou d\'aiguilles provenant d\'une tempé rature trop basse du bain dans le creuset de maintien, en moyenne ou localement. Enrichissement en fer provenant du creuset.\n- Éléments d\'alliage ou de préalliage (par ex. ferro-alliages) qui ne se sont pas complètement dissous dans le bain.\n- Supports de noyaux.\n- Lors de la solidification, il se produit une ségrégation de composés intermétalliques insolubles qui se concentrent dans le liquide résiduel.\n- Éléments d\'alliage incomplètement dissous, alliages-mères ou métaux étrangers introduits accidentellement et inclus lors de la solidification.', '- Veiller à la propreté des charges, éliminer les métaux étrangers.\n- Employer des éléments d\'alliage ou des alliages-mères en morceaux de petite dimension. Veiller à ce que le bain soit assez chaud lorsqu\'on procède à l\'addition. Un brassage énergique accélère la dissolution. Ne pas faire ces additions à un moment trop proche de la coulée.\n- S\'agissant d\'alliages non ferreux, protéger les creusets en fonte à l\'aide d\'un enduit approprié. \n- En coulée d\'alliages d\'aluminium par gravité et sous pression,veiller à ce que la température de maintien soit assez élevée. \n- Décanter soigneusement à la coulée pour éviter d\'entraîner le dépôt du fond du creuset.', 37),
	(93, 'G112', 'Goutte froide', 'None', 'Inclusion de même composition chimique que le métal de base, en général sphérique et souvent enveloppée d\'une couche d\'oxyde.', 'Inclusion métallique généralement sphéroïdale située à la partie inférieure des moulages. Sa composition chimique est identique à celle de la pièce. La surface est généralement oxydée.\n', 'Des gouttes de métal tombées prématurément dans le moule se sont solidifiées et ne se sont pas soudées au métal coulé ultérieurement. Ne pas confondre avec le défaut G 113 (ressuage interne).', '- Protéger les orifices du moule contre les projections.\n- Disposer correctement jets et masselottes (espacement et niveaux respectifs).\n- Couler avec précaution.', 37),
	(94, 'G113', 'Ressuage interne; diamant : goutte phosphoreuse; (fonte)', 'None', 'Inclusions métalliques sphériques dans des soufflures ou autres cavités du moulage ou dans les affaissements de la surface (voir alors défaut A 311). La composition s\'apparente à celle de l\'alliage coulé mais avec des différences qui la rapprochent de celle de l\'eutectique.', 'Inclusion métallique, généralement sphérique à surfaces lisses, souvent brillantes. On la rencontre à l\'intérieur des soufflures ou autres défauts internes qu\'elle remplit totalement ou partiellement. Cette inclusion a généralement une composition chimique différente de celle du métal de base et se rapprochant de la composition de l\'eutectique. C\'est ce qui permet de la distinguer du défaut G 112 (goutte froide).\n', 'L\'eutectique qui se rassemble aux joints des grains en fin de solidification peut être expulsé vers les espaces libres; soit vers les surfaces extérieures où il donne lieu au défaut A 311 (ressuage externe), soit vers les soufflures ou autres défauts internes pour donner le défaut G 113 (ressuage interne). Cette expulsion est provoquée par la pression due à la graphiti sation eutectique dans le cas de la fonte ou au dégagement de ou encore à la contraction de la partie de pièce solidifiée qui commence son retrait. Dans le cas de la fonte ces gouttes sont souvent plus riches en gaz dissous phosphore que la masse de la pièce, d\'où leur nom. Elles présentent une grande dureté et peuvent susciter des incidents à l\'usinage.\n', 'Le meilleur remède consiste à éliminer les défauts primaires : soufflures ou autres cavités sans lesquelles le défaut G 113 ne peut se produire.\n', 37),
	(95, 'G121', 'Inclusions de laitier, de produits de traitement, de flux', 'None', 'Inclusions non métalliques dont l\'aspect ou l\'analyse montrent qu\'elles proviennent des laitiers d\'élaboration, \ndes produits de traitement ou des flux.', 'Inclusions non métalliques de forme irrégulière ayant l\'aspect et la composition des laitiers des fours de fusion ou de traitement (par exemple carbure, produit d\'affinage dans le cas de métaux légers) situées à la surface du moulage (laissant à l\'ébarbage une cavité irrégulière) ou dans la paroi (et alors visibles à l\'usinage). S\'il y a des soufflures voir défaut G 122.\n\nElles apparaissent le plus souvent sur les surfaces supérieures des moulages, près des noyaux ou dans les saillies du moule.', 'Laitier de l\'appareil de fusion ou laitier de traitement par exemple laitier au carbure ayant servi à la désulfuration ou flux de traitement d\'alliage non ferreux entraîné lors de la coulée.\n\nLa scorie s\'accumule à la partie supérieure de l\'empreinte ou reste accrochée, pendant sa montée, dans les angles ou contre les noyaux où elle est emprisonnée à la solidification.', '- Lors du remplissage de la poche, éviter les entraînements de scories venant de l\'appareil de fusion. \n- Décrasser la poche et éventuellement épaissir le laitier avec du sable siliceux propre et sec ou mieux, avec de la chaux. \n- Pendant la coulée retenir le laitier dans la poche, de préférence en employant une poche-siphon ou une poche à quenouille.\n- Maintenir pleins pendant toute la coulée les entonnoirs ou bassins de coulée.\n- Employer des noyaux-filtres.\n- Prévoir des pièges à crasses, par exemple des pièges à circuit tangentiel.\n- Disposer les faces destinées à être usinées à la partie inférieure moule.', 38),
	(96, 'G122', 'Inclusion de scorie congénitale, mousse, soufflures de scories', 'None', 'Inclusions non métalliques en général imprégnées de gaz \net accompagnées de soufflures (B 113).', 'Inclusions non métalliques souvent associées à des soufflures dans les inclusions et dans la masse de la pièce.\n\nRéparties dans la pièce mais le plus souvent dans la partie supérieure du moule ou accrochées aux angles rentrants ou aux noyaux.\n\nL\'analyse chimique révèle de fortes teneurs en soufre ainsi qu\'en oxydes de silicium, fer et manganèse avec des teneurs en chaux voisines de zéro. \n\nL\'examen micrographique ou même visuel laisse parfois apparaître une phase de silice pure en grains blancs qui ne doit pas être confondue avec une inclusion de sable', 'Réactions complexes au sein de l\'alliage liquide entre ses divers consti tuants (carbone, silicium, manganèse, soufre, aluminium, titane, etc.) leurs oxydes, l\'atmosphère, les éléments constituant la poche, le moule ou leurs revêtements.\n\nCes réactions remontent souvent à l\'élaboration du métal voire à la qualité ou au mode d\'élaboration des matières premières.', '- Utiliser des matières premières peu chargées en oxydes métalliques internes (inclusion) ou externes (rouille). \n- Éviter les basses teneurs en silicium et les hautes teneurs en manganèse avec, si possible, Si Mn + 0,5%.\n- Limiter les teneurs en aluminium et en titane.\n- Teneur en soufre inférieure à 0,1%.\n- Élaborer et piquer le métal à haute température.\n- Attendre la température correcte pour couler le moule. \n- Couler rapidement avec un système d\'alimentation évitant la turbulence.', 38),
	(97, 'G131', 'Inclusion de sable', 'None', 'Inclusion de sable en général très près de la surface du moulage.', 'Inclusions de sable de forme irrégulière, le plus souvent compactes au voisinage de la surface supérieure du moulage. Souvent visibles sur le moulage brut de coulée, mais pouvant n\'apparaître qu\'à l\'usinage. En général, il y a en d\'autres endroits de la pièce, des excroissances métalliques massives (sous-groupe de défauts A 220).\n\nComme ci-dessus, mais il y a des cavités de 2 à 6 mm d\'épaisseur, plus ou moins développées, avec en général des inclusions de sable attenantes. Ce défaut apparaît toujours en même temps que les défauts du sous-groupe D 230 (gales).', '- Morceaux détachés du moule ou des noyaux (sous-groupe A 220). \n- Manque de soin au moulage (sous-groupe F 230). -\n- Érosion ou frottes (défauts A 212, A 213). \n- Croûtage du sable dû à la dilatation de la silice (défaut D 230-gale).', 'Voir sous-groupe A 220, sous-groupe D 230 et défauts A 212-A 213.', 39),
	(98, 'G132', 'Inclusion de noir ou de couche', 'None', 'Inclusion de noir ou de couche en général très près de la surface du moulage.', 'Inclusion de peau en génér au-dessous de la surface du moulage dans les régions supérieures du moule. En d\'autres endroits du moulage, il y a des excroissances peu saillantes correspondant à l\'épaisseur de la couche décollée.', 'Parcelles de couche de noir ou d\'enduit exfoliée, détachée et surnageant à la surface du métal liquide lors de sa montée dans le moule.', '- Employer une couche ou un enduit dont le coefficient de dilatation thermique est voisin de celui du matériau constituant le moule.\n- Ne pas employer de noir liquide sur les moules ou noyaux chauds.\n- Limiter l\'épaisseur du noir. \n- Réduire la teneur en argile du noir.', 39),
	(99, 'G141', 'Taches noires', 'None', 'Taches noires irrégulières, nettement délimitées dans la cassure defonte à graphite sphéroïdal.', 'La cassure présente des taches noires nettement délimitées de forme irrégulière ayant quelques millimètres à quelques centimètres dans leur plus grande dimension; surtout dans les épaisseurs supérieures à 25 mm et dans les régions hautes du moulage.\n\nLes caractéristiques mécaniques sont très mauvaises.', 'Très haute teneur du bain en oxydes et sulfures.\n', '- Éviter les fontes neuves à très basses teneurs en silicium. \n- Limitation sévère de la teneur en soufre du bain avant le traitement au magnésium (moins de 0,01%). \n- Emploi de teneur en magnésium aussi faible que possible.\n- Limitation de la teneur en aluminium.\n- Température de coulée aussi élevée que possible.\n- Addition de cryolithe ou d\'autre produit favorisant la coagulation des crasses.\n- Emploi de poche-siphon.\n- Réduction de la turbulence lors du transfert et de la coulée du métal liquide traité au magnésium.', 40),
	(100, 'G142', 'Inclusion d\'oxyde Peaux d\'oxyde', 'None', 'Inclusions en forme de peau constituées d\'oxydes, le plus souvent avec interruption locale de la continuité.', 'Inclusions non métalliques ayant la forme de peaux qui constituent une solution de continuité localisée. La couleur correspond à celle du genre d\'oxyde qui constitue ces inclusions.\n', 'Formation de peaux d\'oxyde lors du remplissage de la poche ou de la coulée dans le moule, ces peaux restant emprisonnées dans le métal liquide sous l\'effet d\'un écoulement turbulent.\n', '- Éviter l\'oxydation du jet de métal.\n- Couler autant que possible sans pression et en source.\n- Employer des canaux et attaques plans et longs. Pour les non ferreux, coulée sans turbulence avec moule à inclinaison variable.\n- S\'agissant de fonte G.S., tenir la teneur en magnésium aussi basse que possible.\n- En outre, prendre les mêmes précautions que contre le défaut G 121 (inclusion de scories).', 40),
	(101, 'G143', 'Peau de graphite brillante', 'None', 'Peaux plissées au brillant graphitique dans la paroi du moulage', 'Minces peaux graphitiques brillantes, bien délimitées, généralement plissées, situées dans une paroi de la pièce et constituant une solution de continuité du matériau. Ne se voient en général que sur la cassure. Ce défaut est souvent accompagné de gerces plus ou moins plissées à la surface du moulage.', 'Les carbures d\'hydrogène présents dans les produits d\'addition ou dans les liants ou agglomérants de moules et de noyaux se gazéifient et subissent un cracking produisant des peaux de carbone brillant dans l\'empreinte. Ces peaux sont entraînées et à la solidification sont emprisonnées dans les parois du moulage, surtout lorsque l\'écoulement du métal liquide a été turbulent.', 'Diminuer dans les matériaux de moulage et de noyautage, la proportion de produits d\'addition susceptibles de former du carbone brillant.', 40),
	(102, 'G144', 'Points durs', 'None', 'Inclusions dures en coulée d\'aluminium par gravité et sous pression.', 'Inclusions dures plus ou moins finement dispersées, quelquefois grossières, situées dans toute la pièce, dans le cas de moulage sous pression d\'alliage léger. Elles se manifestent surtout à l\'usinage ou au traitement de surface.', 'Inclusions de corindon, spinelle, carbure de silicium, de constituants intermétalliques riches en fer.', '- Conduite soignée de la fusion.\n- Dans certains cas assez long maintien du métal liquide permettant la décantation des inclusions non métalliques. \n- Ne pas employer de creusets en fonte garnis d\'un poteyage non approprié.\n- N\'employer que des alliages purs.', 40),
	(103, 'G211', 'Trempe primaire Trempe primaire partielle Zones blanches \nArrêtes blanches Anomalie de dureté', 'None', 'Structure partiellement ou totalement blanche, particulièrement dans les parois minces, les angles saillants et les arrêtes, passant progressivement à la structure normale.', 'Structure de fonte blanche, au moins partiellement, surtout dans les parties minces et aux arêtes, passant progressivement à la structure normale. La transition entre partie grise et partie blanche peut être très progressive (trempe primaire normale) ou discontinue avec taches blanches dans le gris et taches grises dans le blanc (trempe primaire à transition truitée).', 'Le carbone équivalent et/ou le rapport carbone/silicium ne sont pas appropriés à l\'épaisseur des pièces.', '- Inoculer suffisamment.\n- Ralentir la vitesse de refroidissement (par exemple, supprimer les bavures qui créent un refroidissement local).\n- Limiter et contrôler les teneurs en éléments trempants (chrome par exemple).\n- Éviter la surchauffe ou le maintien prolongé à l\'état liquide (trempe pri maire à transition truitée).', 41),
	(104, 'G212', 'Trempe primaire partielle sans transition Trempe nette', 'None', 'Comme G 211 mais avec passage sans transition à la structure normale.', 'Zones ayant la structure de fonte blanche, surtout dans les parties minces, aux arêtes ou au voisinage des bavures, mais contrairement au défaut G 211, le passage de la zone blanche à la zone grise a lieu sans transition.\n', 'Lorsque les causes données pour le défaut G 211 ne sont pas à incriminer: rapport soufre/manganèse trop élevé.\n', 'La trempe nette n\'est pas toujours un défaut. Elle est recherchée au contraire dans certaines applications (cylindres de laminoirs). Elle est favorisée entre autres par un rapport S/Mn élevé.\n\nPour l\'élimination de la partie trempée, avec ou sans transition, voir les remèdes à G 211.', 41),
	(105, 'G213', 'Trempe inverse', 'None', 'Zone blanche nettement délimitée dans les parties de la pièce solidifiées en dernier lieu. La structure près de la surface est grise.', 'La cassure présente des bords de structure grise normale; le centre ou bien est solidifié sous forme de fonte blanche sans zone de transition ou présente des taches blanches ou encore est grossièrement truité.\n', '#NOM?', '- Diminution de la teneur en soufre, éventuellement par un traitement désulfurant. Neutralisation du soufre Mn supérieur à 1,75 S + 0,3. par le manganèse :\n- Surchauffe et inoculation efficace.\n- Diminution de la teneur en hydrogène par l\'emploi de poches bien séchées. Étuvage des moules.', 41),
	(106, 'G221', 'Graphite primaire', 'None', 'Taches foncées dans le moulage brut; cassure gris-noir à gros grains après traitement.', 'Les pièces coulées, avant recuit, ne sont pas intégralement blanches, et elles comportent du graphite primaire. Le défaut est visible sur les cassures qui présentent, avant le traitement, des taches gris foncé dans les parties massives, après traitement, des taches noires à grain grossier.', '- Teneur trop élevée en carbone et silicium eu égard à l\'épaisseur des parois. \n- Effet d\'inoculation des additions.', '- Éviter de fortes différences d\'épaisseur (d\'un point à un autre du moulage) ainsi que les accumulations de chaleur qui peuvent résulter d\'une technique d\'attaque ou de masselottage incorrecte.\n- Employer des refroidisseurs. \n- Ajuster la composition aux épaisseurs de parois, en jouant de préférence sur le carbone pour les malléables à cœur noir et sur le silicium pour les malléables à coeur blanc. Veiller à la propreté des constituants des charges et à une conduite correcte de la fusion.\n- Ajouter du bismuth (70 g par tonne environ).', 42),
	(107, 'G222', 'Couche superficielle dure de faible', 'None', 'Malléable à coeur noir. La cassure après recuit fait apparaître une banqde claire brillante de plus \nde 0.5mm d\'épaisseur au voisinage de la paroi, avec une région interne foncée.', 'La cassure présente après recuit une bordure claire et brillante contrastant avec l\'intérieur sombre. \n\nLa structure comporte une bordure perlitique pouvant contenir du graphite de recuit qui peut d\'ailleurs être précédée d\'une lisière ferritique. \nA cœur : ferrite et graphite de recuit.\n\nUn cordon perlitique de 0,5 mm d\'épaisseur ne constitue pas un défaut.', 'Humidité dans l\'atmosphère du four de traitement, provoquée par un séchage incomplet de la maçonnerie du four ou par des charges de moulages bruts humides.\n\nL\'oxygène et l\'hydrogène d\'une atmosphère humide réagissent à haute température avec la charge du four de traitement.\nPar suite de l\'action décarburante de l\'oxygène, il se forme une lisière ferritique étroite. \n\nL\'hydrogène diffuse vers l\'intérieur du moulage, stabilise la perlite et empêche sa décomposition dans le deuxième stade du traitement."\nSi la bordure de perlite provient de l\'effet d\'une atmosphère carburante dans le four de traitement, il n\'y a pas de lisière ferritique.', '- Veiller à ce que l\'atmosphère du four de traitement soit absolument neutre.\n- Veiller à un séchage complet de la maçonnerie du four.\n- Ne pas charger dans le four de traitement des pièces humides ou rouillées.', 42),
	(108, 'G223', 'Ducissement superficiel localisé', 'None', 'Couche superficielle dure de faible profondeur \ndont la structure comporte des constituants de trempe.', 'Zones martensitiques très dures de faible épaisseur à la surface de la pièce.', 'Fort échauffement superficiel localisé suivi d\'un refroidissement rapide par transmission de la chaleur à la masse froide de la pièce et à l\'air ambiant.\n\nProvoqué par :\n\n- échauffement lors du meulage,\n- production d\'arc par suite d\'un mauvais contact entre l\'électrode et la pièce lors de l\'essai magnétoscopique de contrôle de l\'absence de fissure.', '- Réduire la pression lors du meulage. \n- Effectuer le meulage de la malléable avant le recuit.\n- Disposer les parties à meuler (attaques et attaches de masselottes) en des points qui n\'auront pas à être usinés. Veiller au bon contact des électrodes avec la pièce dans l\'essai magnétoscopique.\n- Ne mettre le courant que lorsque la pièce à essayer est déjà aspergée du liquide contenant la poudre de fer. \n- Les trempes locales peuvent être facilement éliminées par un traitement de revenu (1 à 2 h à 450-650 °C).', 42),
	(109, 'G261', 'Piqûres de graphite', 'None', 'Graphite très grossier régulièrement réparti.', 'Lors de l\'usinage de moulages épais en fonte à graphite lamellaire, surtout dans les régions correspondant à la partie supérieure du moule, apparaissent des porosités plus ou moins grandes à bords déchiquetés, dans lesquelles on observe la présence de poussière de graphite. Le matériau a en général une faible dureté et n\'est souvent pas étanche.', '- Équivalent en carbone trop élevé, surtout du fait du carbone, eu égard à l\'épaisseur des pièces. \r\n- Refroidissement trop lent favorisant la formation de graphite du type A en lamelles très grossières. \r\n- Trop fortes différences d\'épaisseur (défaut de tracé).', '- Améliorer si possible le tracé dans le sens d\'une diminution des plus fortes épaisseurs. \r\n- Ajuster l\'équivalent en carbone et plus particulièrement la teneur en\r\ncarbone en fonction des épaisseurs. \r\n- Éviter une mise au mille de coke exagérée.\r\n- Utiliser des fontes neuves à graphite fin (fontes affinées à bas carbone) de préférence aux fontes neuves à graphite développé. \r\n- Homogénéiser la vitesse de refroidissement par l\'emploi de refroidisseurs intéressant les parties épaisses.\r\n- Utiliser une poche à quenouille ou une poche théière, laisser reposer la fonte liquide avant de couler et ne pas vider la poche complètement dans le moule.\r\n- Couler à la température minimale compatible avec la bonne venue de la pièce.', 46),
	(110, 'G262', 'Nids de graphite', 'None', 'Accumulation locale de graphite grossier dans la structure. Précipitation de graphite dans les cavités (resttasures).', 'A l\'usinage apparaissent des porosités grossières remplies de graphite. Il l y a également du graphite libre dans les retassures. La structure est irrégulière, grossière et sans étanchéité.', 'Les mêmes que pour G 261 mais à un degré plus poussé permettant le rassemblement en amas des inclusions de graphite.', 'Les mêmes que pour G 261 en veillant tout particulièrement à la constitution des charges (coke et fontes neuves).', 46),
	(111, 'G263', 'Décantation de sphérolithes', 'None', 'Amas de sphérules dans les régions supérieures du moulage (fonte G.S).', 'Le matériau a de mauvaises caractéristiques mécaniques. La cassure de moulages ayant des épaisseurs supérieures à 25 mm présente des bordures noires profondes plus ou moins larges situées dans la partie supérieure de la pièce. Dans la zone de décantation l\'examen micrographique fait apparaître des sphérolithes éclatés, ainsi qu\'un enrichissement en sulfures et oxydes de magnésium.', '- L\'équivalent en carbone (CE) est trop élevé, eu égard à l\'épaisseur des parois.\r\n- Le traitement au magnésium et l\'inoculation sont faits à une température trop basse (inférieure à 1450 °C).\r\n- Le maintien entre traitement et coulée est trop long. \r\n- Le refroidissement dans le moule est trop lent.', '- Limiter l\'équivalent en carbone en fonction de l\'épaisseur des parois du moulage. Par exemple:\r\nÉpaisseur: 10 mm........CE maximum : 4,5\r\nÉpaisseur: 30 mm........CE maximum : 4,3\r\n- Effectuer le traitement au magnésium et l\'inoculation dans le domaine des températures optimales c\'est-à-dire entre 1480 et 1510°C. - Couler au plus tard 10 minutes après le traitement.\r\n- Respecter une température de coulée comprise entre 1400 et 1 360 °C. \r\n- Veiller à ce que le refroidissement et la solidification dans le moule soient aussi rapides que possible.', 46),
	(112, 'G264', 'Alignement de sphéroïdes Cassure à facettes', 'None', 'Cassure présentant des facettes planes diversement orientées (fonte G.S., alliage eutectique Al-Si).0', 'La cassure présente une anomalie d\'aspect : facettes planes diversement orientées.\r\n\r\nL\'examen micrographique révèle la présence de dendrites, soulignées par des alignements de graphite dans le cas de la fonte GS.', 'Formation de grandes dendrites lors de la solidification.', 'Cette anomalie n\'est pas un défaut : les caractéristiques mécaniques sta tiques et dynamiques ne sont pas affectées. \r\n\r\nNota: La même anomalie de structure se rencontre avec certains alliages eutectiques Al-Si.', 46);
